ya pasamos el millon\nComo tu me vienes a frontiar\nSi sabes que yo tengo un combo bien cabron \n\nEs bien facil frontial pero en el calenton \nA la hora de guerriar se me escondieron to'' \nYo no soy de los que manda yo me monto \nEl ultimo que frontio preguntale donde fue que se murio\nYo dudo que lo encuentren \nLos bates dan duro duro como flow clemente \nUstedes son calles maliantes de redes pero en las redes no se mata gente \n\nNosotros estamos bendecidos \nPor eso esta gente estan to modios \nTenemos 30 palos moltiao en el barrio y de los 30 15 son mios \nDios bendiga mi Cone y to los mios \nMetieron presion y salieron partios \nTo el que quiera guerriar en contra de mi va a guerriar con Las monjas, La pala, Playita y Caimito\n \nMientras los kilos suben los chavos bajan\nLas coltas y los palos son 9K\nMis diablos prendidos que no le bajan\nY a to el que este perdido me lo trabajan\n\nSeguimos facturando \nUstedes se pasan cambiando de bando\nHablando mucho trayendo y llevando \nEs mejor que te escondas cabron que te estamos buscando\n\nLe dimo a fulano \nNunca hablamos de eso \nRoncaron de calle \nLes cayo to'' el peso \nTo'' mis enemigos en la calle estan muertos \nY los que estan vivos es porque estan presos\n\nVivimos en el fuego \nTu no sabes de eso \nCapsuliando a 200 en el expresso\nA mi me hizo la calle y por eso \n\nComo tu me vienes a frontiar\nSi hace rato que ya pasamos el millon\nComo tu me vienes a frontiar\nSi sabes que yo tengo un combo bien cabron\n\nInstagram: http://bit.ly/2qJjz6T\nFacebook:  http://bit.ly/2CqEgIq\nTwitter: http://bit.ly/2Wguhxh\n\n#Noriel #7D\n\nMusic video by Noriel performing 7D (Official Video). (C) 2022 Sony Music Entertainment US Latin LLC',102339,3812320,3054,'28-Sep-22','Noriel');
