INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('2xWkATdMQms','CJ - WHOOPTY [Official Music Video]','Watch the official music video for Whoopty by CJ.\nStream: https://apple.co/3vlRI9N\n\n:bell: Subscribe to the channel:   \n / @realcj9513  \n\nProd. Pxcoyo\nDirected By : RingRingVisuals\n\nAvailable On All Streaming Platforms:\nTidal: https://listen.tidal.com/album/161141...\nApple Music: https://music.apple.com/us/album/whoo...\nSpotify: https://open.spotify.com/album/5oBYG6...\niHeart Radio: https://iheart.com/artist/cj-6736/son...\n\nFollow CJ:\nIG: https://instagram.com/Realcj_/\nFacebook: https://facebook.com/YeaYouKnowMe1OO\nTwitter: https://twitter.com/youwatchincj\n\nAbout CJ:\nBorn, Chris Soriano, CJ is a Staten Island Native, but with a Puerto Rican background who began his musical career in 2017 at the age of 20 years old. His musical influences include hip hop royalty such as Wu Tang Clan, Jay Z, 50 Cent and Pop Smoke. Raised on the sidelines of the music business, his explosive delivery, intertwined with floe-tic bars, have always been an ear catcher to fans as well as industry executives. \n\nWhile independently pushing his talents and personally structuring his core team, CJ has worked with producers like Dizzy Banko, who produced his song \"Pop\".\n\nOn August 20, 2020, CJ released \"WHOOPTY\" his critically acclaimed single independently with Equity distribution, which gained over 1 million views on YouTube and million on Spotify after a month of its debut. That along with over 4m fan Tik Tok videos have driven the awareness of CJ\''s debut. Song delivery mixed with his explosive music video, CJ is definitely one to watch and not be taken lightly.\n\nLyrics: \nLoyalty over royalty, \ny\''all niggas know the vibes \n(Pxcoyo killed this beat, bitch)\n\n(Chorus) \nWhoopty \nBitch, I\''m outside it\''s a movie \nBlue cheese \nI swear I\''m addicted to blue cheese \nI gotta stick to this paper-li