INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('RdTocu-_hiE','Oxford University Exeter College Library Tour (pre-renovation)','In this old (and slightly long) video, I bring you around my college library before it was closed for renovation. Now I am so glad I filmed this as a memorabilia of all the times I used to go there to study (and see Walter the college cat). Hopefully I will be able to come back and give you another tour once the renovation is complete! Please comment down below which other Oxford libraries you would like to see - I am hoping to make a compilation :)\n\nAbout me: I\''m a medical student at Oxford University, coming all the way from Singapore (international student)! I\''ll be using this channel to document my journey and share simple tips and advice for medicine and/or studying. Hopefully this will give you some insight into what it\''s like to be a student at Oxford :)\nBlog: https://www.medicinspires.com/',101,1024,14,'22-Mar-23','ZQ');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('-15e2Br8W4Y','Hypovolemia Fluid Volume Deficit | Dehydration Nursing NCLEX Treatment, Pathophysiology','Hypovolemia is also referred to as fluid volume deficit or dehydration. Hypovolemia is a low fluid in the blood. Fluid volume deficit can occur due to a loss of water or electrolytes in the body. Learn about the causes, symptoms, treatments, types, diagnostics to watch, and more as a part of the nursing NCLEX review.\n\nQuiz: https://www.registerednursern.com/hyp...\n\nNotes: https://www.registerednursern.com/flu...\nThere are three main types of dehydration: hypertonic dehydration, hypotonic dehydration, and isotonic dehydration. \n\nSigns and symptoms of fluid volume deficit include: dry mucous membrances, increased heart rate, hypotension, decreased skin turgor, increased capillary refill etc.\n\nTreatment goals are to replace the fluid or electrolytes lost. The nurse would want to weigh patient daily, administer fluids per doctor\''s order, obtain strict intake and output etc.  \n\nWebsite: https://www.registerednursern.com/\nMore Videos:   \n * Dopamine IV Drip ...  \nNursing Gear: https://teespring.com/stores/register...\nInstagram: https://www.instagram.com/registeredn...\nFacebook: https://www.facebook.com/RegisteredNu...\nTwitter: https://twitter.com/NursesRN\n\n\nPopular Playlists:\n\nNCLEX Reviews:   \n * NCLEX Study Strat...  \nFluid & Electrolytes:   \n * Fluid and Electro...  \nNursing Skills:   \n * Nursing Skills Vi...',239,7226,9,'22-May-23','RegisteredNurseRN');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('hNCmb-4oXJA','Us - Official Trailer [HD]','Us\nIn Theaters March 22, 2019\nhttps://www.UsMovie.com\n\nAfter sending shockwaves across contemporary culture and setting a new standard for provocative, socially-conscious horror films with his directorial debut, Get Out, Academy Award(R)-winning visionary Jordan Peele returns with another original nightmare that he has written, directed and produced.\n\nSet in present day along the iconic Northern California coastline, Us, from Monkeypaw Productions, stars Oscar(R) winner Lupita Nyong\''o as Adelaide Wilson, a woman returning to her beachside childhood home with her husband, Gabe (Black Panther\''s Winston Duke), and their two children (Shahadi Wright Joseph, Evan Alex) for an idyllic summer getaway. \n\nHaunted by an unexplainable and unresolved trauma from her past and compounded by a string of eerie coincidences, Adelaide feels her paranoia elevate to high-alert as she grows increasingly certain that something bad is going to befall her family.\n\nAfter spending a tense beach day with their friends, the Tylers (Emmy winner Elisabeth Moss, Tim Heidecker, Cali Sheldon, Noelle Sheldon), Adelaide and her family return to their vacation home. When darkness falls, the Wilsons discover the silhouette of four figures holding hands as they stand in the driveway. Us pits an endearing American family against a terrifying and uncanny opponent: doppelgangers of themselves. \n\nWriter and director Peele produces for his Monkeypaw Productions alongside Sean McKittrick, Jason Blum, and Monkeypaw\''s Ian Cooper. Us will be released by Universal Pictures on Friday, March 22, 2019.',339242,35362518,32657,'25-Dec-18','Universal Pictures');
