INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('VoWqeaNMJOM','BMW iX review: 0-60mph, Autobahn and range test!','Need help buying your next car? Click the following link and my team and I will help you choose your ideal car at a fair price - from Mat Watson! http://bit.ly/-Help-Me-carwow\n.............................................................\n\nHere\''s the BMW iX - BMW\''s first purpose-built, all-electric SUV!\n\nSo does the iX stand a chance against class leaders like the Tesla Model X or Audi e-tron? Well, it\''s time to find out! \n\nStarting with the exterior design, there\''s no denying that it\''s certainly striking! Sure, it doesn\''t need the massive \''grille\'' upfront, but if anything it clearly helps it to stand out on the road. What\''s more, the high-quality of the outside continues through to the inside, where you\''ll find a minimalist design coupled with a load of tech. \n\nThe performance isn\''t all that bad either! When it comes to the range-topping xDrive50 edition, it comes equipped with a 100kWh battery which is good for a claimed range of 373 miles. It also produces 500hp, and can hit 60mph in under five seconds! \n\nSo the question is - is it really worth the L95,000 starting price for the range-topping iX50? And should you consider it over a Model X? You\''ll have to stick with Mat to find out!\n\nChapters\n00:00 Intro\n00:42 Exterior Design\n02:30 Interior\n07:15 Back Seats\n08:35 Boot\n09:53 Five Annoying Features\n12:01 Five Cool Features\n13:32 Driving & Range Test\n19:40 Batteries & Charging\n20:18 0-60mph\n20:39 Range\n21:25 Verdict\n\nMercedes EQC review - https://bit.ly/Mercedes-EQC-Review-2021\n\nAn EV SUV that\''s L50k LESS than the iX - https://bit.ly/EV-SUV-Deal\n.............................................................\nInstagram - http://www.instagram.com/carwow\n\nTiktok - https://www.tiktok.com/@carwow\n\nFacebook - http://www.facebook.com/carwowuk\n\nTwitter - http://www.twitter.com/carwowuk\n\nSign Up to our Newsletter - http://bit.ly/carwow-Newsletter\n\nAwkward haggling is a thing of the past with carwow. Choose your perfect car with our configurator tool and let the country\''s best dealers compete over you. Compare the five best offers by price, location and dealer ratings and choose the one that\''s right for you - no hassle, no haggling, just a great deal. \n\nOder auch in Deutschland Geld beim Autokauf sparen - http://bit.ly/carwow-DE\n\nVisita nuestra pagina web para saber cuanto te puedes ahorrar en tu nuevo coche - http://bit.ly/carwow-ES',54298,2804827,5583,'29-Sep-21','carwow');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('itk_ANfgvIA','Watch this before you study at The University of Queensland? (University of Queensland Review 2022)','It\''s been a couple of years since I last visited the University of Queensland, and I\''m wondering what\''s changed. \n\nBut even more so, I\''m wondering what kind of person would be best suited to studying here?\n\nBecause yes, it is a prestigious institution. \n\nAnd yes, it has strong research and academic teaching programs. \n\nBut what about everything else? \n\nDoes UQ really give students an opportunity to become well-rounded? Is student life good here? Are there jobs and accommodation nearby?\n\nThese are all questions I\''m looking to answer... because they are important questions for YOU to understand if you\''re going to be sure the UQ is the uni for you!\n\n#uq #studyinaustralia #universityofqueensland\n\nCHAPTERS\n00:00 Introduction\n00:40 The biggest changes at the University of Queensland this year\n02:45 Is UQ the right uni for you?\n04:09 What are the eating options at the University of Queensland?\n04:26 Living near the University of Queensland\n04:56 Extracurricular activities at the University of Queensland: exchange, leadership, entrepreneurship, careers, scholarships and more\n05:58 The University of Queensland\''s Sports Program and Facilities\n06:33 Student life and the vibe on campus at the University of Queensland\n\n\n****\nI love your questions - so don\''t be afraid to ask me anything down below and I\''ll get back to you!\n:point_down::point_down::point_down:\n\n****\nGoing to university is a big decision. \n\nIt\''s going to take years of your life and cost you tens of thousands of dollars. \n\nSo don\''t you want to make sure you have the best, independent advice to help guide that decision?\n\nThat\''s the WHOLE reason I created Choosing Your Uni for you. \n\nSo make sure you subscribe so you don\''t miss out on valuable, independent content so you get the decision right :bell: :bell: :bell:\n\nAnd if you find this video useful please tell someone about this channel to make sure they have the best possible advice too :pray:\n\n***\n\nMore Info: www.choosingyouruni.com \nFacebook: www.facebook.com/choosingyouruni \nInstagram: www.instagram.com/choosingyouruni\n\nRob Malicki: \nLinkedIn www.linkedin.com/in/robmalicki/ \nInstagram @alifethattravels\n\n#university #studyinaustralia #highereducation\n\nSong: MBB - Sunrise\nMusic provided by Vlog No Copyright Music.\nCreative Commons - Attribution-ShareAlike 3.0 Unported\nVideo Link:   \n * MBB - Sunrise (Vl...',350,18036,79,'14-Mar-22','Choosing Your Uni');
