uss your RV questions you can set one up here:  https://endlessrving.com/consultations/\n\nSubscribe to our channel below:\n\nEndless RVing YouTube Channel:\n  \n / @endlessrving  \n\nIf you have questions you want to ask us regarding buying a new RV or other general RV questions you can book a phone consultation with us by clicking here:  https://endlessrving.com/consultations/\n\nIF YOU ENJOY OUR VIDEOS AND WOULD LIKE TO DONATE AND SUPPORT THE CHANNEL CLICK HERE: https://www.paypal.com/cgi-bin/webscr...\n\nSPECIAL THANK YOU TO THE ERV INSIDERS:\n\nTHE ERV INSIDERS is your opportunity to get up close and personal with Endless RVING.  Joining the ERV Insiders gives you exclusive access to Endless RVing and helps support the channel.  We hope to see you on the Inside!! \n\nJOIN HERE:   \n / @endlessrving  \n\nOUR AMAZON STORE IS LIVE WITH ALL OF THE ITEMS ERV USES AND HAS REVIEWED.  THIS IS AN EASY WAY TO GET GREAT PRODUCTS AND SUPPORT THE CHANNEL:\n\nhttps://www.amazon.com/shop/endlessrving\n\nBelow we link the items talked about in the video through our Amazon Affiliate Links.  What are Amazon affiliate links? It\''s a way for you to help your favorite creators! It doesn\''t cost you anything to use our links and we will get a small % of the sale. It\''s a win win! We give info, our time, and our honest opinion, you buy what you were going to anyway and tell us thanks by using our link! \n\nAmazon Affiliate Links Below:\n\nEquipment used to shoot video:\n\nSONY A6400 CAMERA:  https://amzn.to/2RWsxt1\n\nSIGMA 16MM F1.4 DC DN WIDE ANGLE LENS:  https://amzn.to/2NqV1Ij\n\nGoPro Hero 10 Action Camera: https://amzn.to/3nw2q8m\n\nComica X-D Wireless Mics : https://amzn.to/2SwpuXr \n\nDJI RONIN SC GIMBAL:  https://amzn.to/2RqzksU\n\nPLEASE FOLLOW US ON INSTAGRAM, FACEBOOK AND TWITTER @ ENDLESS RVing.\n\nWe will continue to work tirelessly to create the best RV content on YouTube so please SUBSCRIBE, LIKE, SHARE, and COMMENT below and check out our other videos.  Your support helps us grow and allows us to reach more members of the RV community.\n\nThis channel is for entertainment purposes only. We are not RV experts and are not making recommendations. We share our opinions, experiences and what works for us, but you should do your due diligence and make your own decisions.  \n\nTHANK YOU EVERYONE FOR YOUR CONTINUED SUPPORT OF THE CHANNEL.\n\nIZZY, MJ, AND JASON\n\n#rv #glamping #endlessrving',1310,22345,74,'25-May-23','Endless RVing');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('x2BQyZorSQc','Aliens & Espionage: Crop Circles and the CIA Coverup | They Don\''t Want You to Know','Bring some Hot and Savory healthiness to your own life with Huel: https://my.huel.com/thewhyfiles Thanks Huel for sponsoring this video!\n\nAliens & Espionage: Crop Circles and the CIA Coverup\n\nIn 1974 a group of scientists beamed a message into space. The message, meant to be received by an intelligent alien species, described life on Earth.\n\nWritten in simple binary code, and using the most powerful radio telescope on the planet, the message was broadcast to a dense cluster of stars in the constellation of Hercules.\n\nThis exercise was just ceremonial; a way to demonstrate new technology in radio astronomy. Nobody was really expected to receive it. And even if they did, it wouldn\''t be any time soon. The nearest star in the direction of the broadcast is 25,000 light-years away. \n\nSo, the telescope was tuned to 2380 Megherz, aimed at Hercules, and fired up. The scientists congratulated each other, shook hands, and went on with their lives.\n\nBut 27 years later, something very unexpected happened with that message beamed into deep space.\n\nWe got a reply.\n\n#CIA #CropCircles #Conspiracy\n\n:wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash:\nEXECUTIVE PRODUCERS:\nGino Gentile\nJennifer Gentile\nAJ Gentile\nPatreon Members\n\nTHANK YOU MODS:\njengen13 (Mrs. Why Files)\nDaniel Van Auken\nVictoria Young\nZanythos\nLoolykins\nJohnnyBGood\nCricket\nBrett\nKotenuki\nHybrid\nWingedSpider\nJschopp\nThe Darkness\nPaul Rohrbaugh\n\n:wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::wavy_dash::