INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('eIvbEC8N3cA','MA - Official Trailer','MA - In Theaters May 31\nhttps://www.mamovie.com/\n#MAmovie\n\nEverybody\''s welcome at Ma\''s. But good luck getting home safe.\n\nOscar(R) winner Octavia Spencer stars as Sue Ann, a loner who keeps to herself in her quiet Ohio town. One day, she is asked by Maggie, a new teenager in town (Diana Silvers, Glass), to buy some booze for her and her friends, and Sue Ann sees the chance to make some unsuspecting, if younger, friends of her own. \n\nShe offers the kids the chance to avoid drinking and driving by hanging out in the basement of her home. But there are some house rules: One of the kids has to stay sober. Don\''t curse. Never go upstairs. And call her \"Ma.\"\n\nBut as Ma\''s hospitality starts to curdle into obsession, what began as a teenage dream turns into a terrorizing nightmare, and Ma\''s place goes from the best place in town to the worst place on earth.\n\nMa also stars Juliette Lewis (August: Osage County) as Maggie\''s mom, Luke Evans (Beauty and the Beast) as a local dad, Missi Pyle (Gone Girl) as his girlfriend, and McKaley Miller (TV\''s Hart of Dixie), Corey Fogelmanis (TV\''s Girl Meets World), Gianni Paolo (TV\''s Power) and Dante Brown (Lethal Weapon TV series) as Maggie\''s friends.  \n\nFrom Tate Taylor, the acclaimed director of The Help and Get On Up, and blockbuster producer Jason Blum (Get Out, Halloween, The Purge series) comes a thriller anchored by a daring and unexpected performance from Spencer, one of the most powerful actors of her generation.\n\nMa is written by Scotty Landes (Comedy Central\''s Workaholics), is produced by Blum for his Blumhouse Productions, by Taylor, and by John Norris (executive producer, Get On Up), and is executive produced by Spencer, Couper Samuelson, Jeanette Volturno, and Robin Fisichella.',93072,12495407,8774,'13-Feb-19','Universal Pictures');
