INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('POPoJfD96f4','Period Poverty: Sanitary Pads Empower Gambian Women and Girls','Many women and girls in the Gambia cannot afford menstrual products during period. This \"period poverty\" is more acute in rural areas, including Basse, in the country\''s Upper River Region. As a result, some girls miss schools during period and lag behind academ ically. To tackle this problem, United Nations Population Fund (UNFPA) and its partners manufacture sanitary pads at a production - support centre and distribute them among women and girls in various parts of the country. The agency also disseminates informa tion on sexual and reproductive health and supports community efforts to end period shaming and stigma. Fatoumatta Fatty is one of the women who work at the pad production - support centre. She had many challenges in life with her disabilities,  but since she learned sewing skills and started working for the centre, her life has become better . Fatoumatta takes pride i n making products that help other women and herself. (Video produced in partnership with UNFPA).',43,481,0,'27-May-23','United Nations');
