INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DSsrNJxSocU','Investment options that help provide clean water are available, but uptake is low | FT Moral Money','A quarter of the world\''s population has no access to safely managed water, but what role can private investors play in alleviating the problem? Options range from venture capital funds looking to invest in clean-water tech, to private equity funds focused on promoting access to safe drinking water. But as the FT\''s Kenza Bryan reports, the private sector could still do much more. \n\n#cleanwater #privatesector #venturecapital\n\nSee if you get the FT for free as a student (http://ft.com/schoolsarefree) or start a L1 trial: https://subs.ft.com/spa3_trial?segmen....\n\n> Check out our Community tab for more stories on the economy.\n>  Listen to our podcasts: https://www.ft.com/podcasts\n>  Follow us on Instagram:  https://www.instagram.com/financialti...',23,825,1,'24-May-23','Financial Times');
