INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('0xNjDgqFhb0','Serbian troops on alert after violent clashes in Kosovo | DW News','Serbia has moved army units to its border with Kosovo, after clashes between Kosovan police and members of the country\''s ethnic Serb minority. \nThe unrest began when Serbs tried to prevent newly elected ethnic Albanian officials from entering municipal buildings in the north. Serbs form the majority there - and boycotted last month\''s elections. That allowed Albanian candidates to win on a turnout of just over 3 percent. In 2008 Kosovo declared independence, which Serbia rejects.\n\nSubscribe: https://www.youtube.com/user/deutsche...\n\nFor more news go to: http://www.dw.com/en/\nFollow DW on social media:\n>Facebook: https://www.facebook.com/deutschewell...\n>Twitter: https://twitter.com/dwnews\n>Instagram: https://www.instagram.com/dwnews\n>Twitch: https://www.twitch.tv/dwnews_hangout\nFur Videos in deutscher Sprache besuchen Sie:   \n / dwdeutsch  \n\n#Kosovo #Serbia #Albania',138,6105,0,'27-May-23','DW News');
