INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('xKJmEC5ieOk','IT - Official Trailer 1','In Theaters September 8\n\nhttp://itthemovie.com/\nhttps://www.facebook.com/ITMovie/\nhttps://www.instagram.com/itmovieoffi...\nhttps://twitter.com/ITMovieOfficial\n\nNew Line Cinema\''s horror thriller \"IT,\" directed by Andres Muschietti (\"Mama\"), is based on the hugely popular Stephen King novel of the same name, which has been terrifying readers for decades.\n\nWhen children begin to disappear in the town of Derry, Maine, a group of young kids are faced with their biggest fears when they square off against an evil clown named Pennywise, whose history of murder and violence dates back for centuries.  \n\n\"IT\" stars Bill Skarsgard (\"Allegiant,\" TV\''s \"Hemlock Grove\") as the story\''s central villain, Pennywise.  An ensemble of young actors also star in the film, including Jaeden Lieberher (\"Midnight Special\"), Jeremy Ray Taylor (\"Alvin and the Chipmunks: The Road Chip\"), Sophia Lillis (\"37\"), Finn Wolfhard (TV\''s \"Stranger Things\"), Wyatt Oleff (\"Guardians of the Galaxy\"), Chosen Jacobs (upcoming \"Cops and Robbers\"), Jack Dylan Grazer (\"Tales of Halloween\") and Nicholas Hamilton (\"Captain Fantastic\").\n\nMuschietti is directing \"IT\" from a screenplay adapted by Chase Palmer & Cary Fukunaga and Gary Dauberman.  Dan Lin, Roy Lee, Seth Grahame-Smith, David Katzenberg and Barbara Muschietti are producing, with Marty P. Ewing, Doug Davison and Jon Silk serving as executive producers.\n\nThe behind-the-scenes creative team includes director of photography Chung-Hoon Chung (\"Me and Earl and the Dying Girl\"), production designer Claude Pare (\"Rise of the Planet of the Apes\"), editor Jason Ballantine (\"The Great Gatsby\"), and costume designer Janie Bryant (TV\''s \"Mad Men\").\n\nA presentation of New Line Cinema, \"IT\" will be released worldwide beginning September 8, 2017, by Warner Bros. Pictures, a Warner Entertainment Company.',269179,44339331,21274,'27-Jul-17','Warner Bros. Pictures');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('9C2fSBHryiQ','UK Immigration: With Net figure rising to 606,000, what do people think?','Immigration has been an issue which provokes strong opinions from across the country - with widespread recognition for the contribution that migrants make to both the economy and the national life. \n\nBut some have worried about the added pressures that increase numbers place on already-stretched public services like schools and hospitals.\n\nSo, how are people reacting to net migration\''s numbers? Sky News\'' Communities Correspondent Lisa Holland reports from Coventry.\n\nSUBSCRIBE to our YouTube channel for more videos:   \n / skynews   \n\nFollow us on Twitter: https://twitter.com/skynews \nLike us on Facebook: https://www.facebook.com/skynews \nFollow us on Instagram: https://www.instagram.com/skynews \nFollow us on TikTok: https://www.tiktok.com/@skynews \n\nFor more content go to http://news.sky.com and download our apps: \nApple https://itunes.apple.com/gb/app/sky-n... \nAndroid https://play.google.com/store/apps/de... \n\nSky News Daily podcast is available for free here: https://podfollow.com/skynewsdaily/\n\nSky News videos are now available in Spanish here/Los video de Sky News estan disponibles en espanol aqui:   \n / @skynewsespanol   \n\nSky News videos are also available in German here/Hier konnen Sie ausserdem Sky News-Videos auf Deutsch finden:   \n / @skynewsaufdeutsc...   \n\nTo enquire about licensing Sky News content, you can find more information here: https://news.sky.com/info/library-sales',139,24494,326,'25-May-23','Sky News');
