INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('dKi5XoeTN0k','Fast & Furious 6 Official Trailer #1 (2013) - Vin Diesel Movie HD','Subscribe to TRAILERS: http://bit.ly/sxaw6h\nSubscribe to COMING SOON: http://bit.ly/H2vZUn\nLike us on FACEBOOK:http://goo.gl/dHs73.\nSubscribe to INDIE TRAILERS: http://goo.gl/iPUuo\nFast & Furious 6 Official Trailer #1 (2013) - Vin Diesel Movie HD\n\n\nVin Diesel, Paul Walker and Dwayne Johnson lead the returning cast of all-stars as the global blockbuster franchise built on speed races to its next continent in \"Fast & Furious 6.\" Reuniting for their most high-stakes adventure yet, fan favorites Jordana Brewster, Michelle Rodriguez, Tyrese Gibson, Sung Kang, Gal Gadot, Chris \"Ludacris\" Bridges and Elsa Pataky are joined by badass series newcomers Luke Evans and Gina Carano.',98912,29256273,15305,'5-Feb-13','Rotten Tomatoes Trailers');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('MM0Sbfvf2Hw','How to Count in Base 2i','Let me show you the mysterious powers of Base 2i (and other interesting bases you\''ve probably never heard of).\n\nLinks to my episodes about negative bases and irrational bases:\nHow to Count in Base Negative 10 -   \n * How to Count in B...  \nHow to Count in Fractional and Irrational Bases -   \n * How to Count in F...  \n\nSpecial thanks to Evan Clark, and to my Patreon supporters: Tybie Fitzhugh, Henry Spencer, Mitch Harding, YbabFlow, Plenty W, Quinn Moyer, Julius 420, Philip Rogers, Ilmori Fajt, Brandon, August Taub, Ira Sanborn, Matthew Chudleigh, Cornelis Van Der Bent, Craig Butz, Mark S, Thorbjorn M H, Mathias Ermatinger, Edward Clarke, and Christopher Masto, Joshua S, Max, Joost Doesberg, Adam, Chris Reisenbichler, Stan Seibert, Amy, Izeck, and Max.\n\nCombo Class Links:\nPatreon: https://www.patreon.com/comboclass\nDomotro bonus channel:   \n / @domotro  \nReddit: https://www.reddit.com/r/comboClass/\nDiscord: https://discord.gg/cHHvDcPPuc\n\nThis episode is about the strange mathematical and philosophical potentials of imaginary and complex positional numeral bases, and what they can achieve within the complex numbers and the \"Gaussian integers\". It mostly focuses on Base 2i, also known as the \"quater-imaginary base\" (original written about by Donald Knuth). We will also discuss the \"Base i-1\" (a.k.a. Base -1+i)\" and \"Base -i-1\" (a.k.a Base -1-i) systems, and how they relate to a cool fractal shape. We\''ll also look at the similarities (and differences) between these ways of counting and other possible bases such as negative bases, square root bases, and more!\n\nIf you\''re reading this, leave a comment with which base is your favorite!\n\nDisclaimer: Do not copy any physical actions you see in Combo Class episodes, including any use of fire, tools, or other science experiments.',1737,19265,285,'23-Jan-23','Combo Class');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('QvFoRk4JsPc','Autonomous 8R Tractor | John Deere Precision Ag','Introducing John Deere\''s autonomous 8R Tractor for large-scale production. The 8R tractor with a TruSetTM-enabled chisel plow, StarFireTM GPS guidance system,  and new advanced technologies will help farmers grow more for a growing planet. \n\nThe John Deere autonomous tractor has six pairs of stereo cameras, which enables 360-degree obstacle detection and the calculation of distance. Images captured by the cameras are passed through a deep neural network that classifies each pixel in approximately 100 milliseconds and determines if the machine continues to move or stops, depending on if an obstacle is detected. John Deere\''s autonomous tractor is also continuously checking its position relative to a geofence, ensuring it is operating where it is supposed to, and is within less than an inch of accuracy. \n\nTo use the John Deere autonomous tractor, a farmer only needs to transport the machine to a field and configure it for autonomous operation. Using John Deere Operations Center Mobile, he or she can swipe from left to right to start the machine. While the machine is working the farmer can leave the field to focus on other tasks, while monitoring the machine\''s status from their mobile device. \n\nOur autonomous tractor serves a specific purpose: feeding the world. The global population is expected to grow from about 8 billion to nearly 10 billion people by 2050, increasing the global food demand by 50%. Furthermore, farmers must feed this growing population with less available land and skilled labor, and work through the variables inherent in farming like changing weather conditions and climate, variations in soil quality and the presence of weeds and pests. All of these factors impact a farmer\''s ability to farm during the most critical times of the year. \n\nJohn Deere Operations Center Mobile provides access to live video, images, data and metrics, and allows a farmer to adjust speed, depth and more. In the event of any job quality anomalies or machine health issues, farmers will be notified remotely and can make adjustments to optimize the performance of the machine. \n\nThe autonomous tractor will be available to farmers in late 2022. To learn more, visit https://www.JohnDeere.com/CES. \n\n0:00 - Driven by Customer Input: 4th Generation Farmer, Doug Nimz\n1:00 - Fully Autonomous Operation Controlled by John Deere Operations Center Mobile\n1:59 - Overcoming Labor Shortage & Weather Challenges \n2:35 - Future of Farming Technology \n\n#JohnDeere #CES2022 #Autonomy #AutonomousTractor\n\n:white_check_mark: Subscribe for more John Deere videos: http://bit.ly/2Yo9Oad\n\n--- Follow Us ---\nTWITTER: https://twitter.com/johndeere\nFACEBOOK: https://www.facebook.com/johndeereusca\nINSTAGRAM: https://www.instagram.com/johndeere/\nLINKEDIN: https://www.linkedin.com/company/john...\n\n--- More from John Deere ---\nFind a Dealer: http://bit.ly/2l8PivS\nVisit our Website: https://www.deere.com',3738,365673,323,'4-Jan-22','John Deere');
