INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DvHJtez2IlY','The OA | Official Trailer [HD] | Netflix','Trust the unknown. Netflix Original Series \''The OA\'' is now streaming on Netflix.\n\ninstagram.com/the_OA\n\nFrom Brit Marling and Zal Batmanglij, the visionary filmmakers behind Sound of My Voice and The East, comes a powerful, mind-bending tale about identity, human connection and the borders between life and death. The Netflix original series The OA is an odyssey in eight chapters produced in partnership with Plan B Entertainment, Netflix and Anonymous Content. The groundbreaking series offers audiences a singular experience that upends notions about what long-format stories can be.\n\nWatch The OA Now: https://www.netflix.com/title/80044950\n\nSUBSCRIBE: http://bit.ly/29qBUt7\n\nAbout Netflix:\nNetflix is the world\''s leading internet entertainment service with 130 million memberships in over 190 countries enjoying TV series, documentaries and feature films across a wide variety of genres and languages. Members can watch as much as they want, anytime, anywhere, on any internet-connected screen. Members can play, pause and resume watching, all without commercials or commitments. \n\nConnect with Netflix Online:\nVisit Netflix WEBSITE: http://nflx.it/29BcWb5\nLike Netflix on FACEBOOK: http://bit.ly/29kkAtN\nFollow Netflix on TWITTER: http://bit.ly/29gswqd\nFollow Netflix on INSTAGRAM: http://bit.ly/29oO4UP\nFollow Netflix on TUMBLR: http://bit.ly/29kkemT\n\nThe OA | Official Trailer [HD] | Netflix\n  \n / netflix',39567,7771680,4231,'12-Dec-16','Netflix');
