INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('p84hCsv-FqI','Vitamin B6 (Pyridoxine) Deficiency | Dietary Sources, Causes, Signs & Symptoms, Diagnosis, Treatment','Vitamin B6 (Pyridoxine) Deficiency | Dietary Sources, Causes, Signs & Symptoms, Diagnosis, Treatment\n\nVitamin B6 (pyridoxine) is a water-soluble vitamin required for a variety of bodily processes, including nutrient metabolism, neurological functioning, and immune system functioning. Dietary sources of pyridoxine include meat/fish, nuts, legumes, and vegetables. In this lesson, we discuss the absorption, metabolism, and excretion of vitamin B6, along with causes of deficiency, signs & symptoms of deficiency, how vitamin B6 deficiency is diagnosed and how it is treated.\n\nIf you found this lesson helpful, please like and subscribe for more lessons like this one!\n\nJJ\n\n**PLEASE DONATE to help support this channel > https://www.patreon.com/jjmedicine **\n\n-------------------------------------------------------------------------------------------------------------\nFor books and more information on these topics \nhttps://www.amazon.com/shop/jjmedicine\n\nCheck out the best tool to help grow your YouTube channel (it\''s helped me!)\nhttps://www.tubebuddy.com/jjmedicine\n\nSubscribe for more free medical lessons   \n / @jjmedicine  \n\nFollow me on Twitter! > https://twitter.com/JJ_Medicine\nCome join me on Facebook! > https://www.facebook.com/JJ-Medicine-...\n\n-------------------------------------------------------------------------------------------------------------\n\nEXCLAIMER: The content used in this lesson is used in accordance with Fair Use laws and is intended for educational purposes only.\n\n**MEDICAL DISCLAIMER**: JJ Medicine does not provide medical advice, and the information available on this channel does not offer a diagnosis or advice regarding treatment. Information presented in these lessons is for EDUCATIONAL PURPOSES ONLY, and information presented here is NOT TO BE USED as an alternative to a healthcare professional\''s diagnosis and treatment of any person/animal. \n\nOnly a physician or other licensed healthcare professional are able to determine the requirement for medical assistance to be given to a patient. Please seek the advice of your physician or other licensed healthcare provider if you have any questions regarding a medical condition. \n\n-------------------------------------------------------------------------------------------------------------\n\nCheck out some of my other lessons.\n\nMedical Terminology - The Basics - Lesson 1:\n  \n * Medical Terminolo...  \n\nInfectious Disease Playlist\n  \n * Infectious Diseases  \n\nDermatology Playlist\n  \n * Dermatology  \n\nPharmacology Playlist\n  \n * Pharmacology  \n\nHematology Playlist\n  \n * Hematology  \n\nRheumatology Playlist\n  \n * Rheumatology  \n\nEndocrinology Playlist\n  \n * Endocrinology  \n\nNephrology Playlist\n  \n * Nephrology  \n\n---------------------------------------------------------------------------------------\n\nAlthough I try my best to present accurate information, there may be mistakes in this video. If you do see any mistakes with information in this lesson, please comment and let me know.',1536,110871,89,'16-Oct-20','JJ Medicine');
