INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('SRec90j6lTY','What Is UX Design? - A Full Overview','What actually IS UX Design? How can you take an experience that already exists, and improve it for the user? In this video, one of our senior product / UX designers, Dee, defines the term \''UXD\'', and describes the 3 essential areas that make for GREAT User Experiences. \n\nDee offers practical examples of GOOD and BAD UX Design, and what the implications of each can be, along with insights of what you can expect to do in a UX Design role, based on her 10+ years of experience in the UX industry! \n\nHow do you define UX / User Experience Design?! What insights can you offer on getting started in the industry? Share your thoughts in the comments below! \n\n:white_check_mark: Check out our new FREE FACILITATION TRAINING and learn the 5 things you can do to become a top 1% facilitator and earn 6 figures while doing it!  :point_right: https://go.ajsmart.com/start\n\nAlso if you haven\''t already, subscribe to our Youtube channel for weekly UX / UI / Career / and Design Sprint videos: \n:heart:https://www.youtube.com/AJ&Smart?sub_... :wink:\n\nThanks for watching! \n\nPlease click here (https://www.youtube.com/AJ&Smart?sub_...) to subscribe to our channel for more videos on UX / UI Design, resources, links, advice on finding work and much much more! \n\n:mag_right:Key points in the video:\n\n00:46 What Is UX Design \n02:00 Factors Involved in UX Design + Example \n04:07 The Core of UX Design (It\''s ALL About The User\n04:51 Examples of Bad UX Design \n05:58 What Does The UX Process Look Like \n07:41 The Four BASIC Key Steps \n07:56 What Would I Actually Be Doing As A UX Designer \n11:27 Bloopers / Outtakes \n\n:mega: FREE FACILITATION TRAINING!  :point_right: https://go.ajsmart.com/start\n\nWe\''ve JUST launched a new 1-hour facilitation training, where we\''ll teach you:\n\n:white_check_mark:How we landed facilitation gigs with the world\''s best companies (Google, Twitter, LEGO & more!)\n:white_check_mark:How to successfully build & facilitate ANY workshop, even when you\''re not a subject-matter expert\n:white_check_mark:How to become a high-paid facilitator in 90 days or less, using our special \''5-1-6 method\''.\nInterested? This training is available for a limited time only, so unlock it now and start watching!\n\n\n*OUR SOCIAL CHANNELS*\n\nIf you want access to exclusive UX / UI design resources, links and commentary - sign up for our FREE (and non-spammy!) weekly newsletter here: :point_down:\n:pencil:https://aj-smart.ck.page/21100f1c73 :eyes:\n\nThe Product Breakfast Club Podcast:\nhttps://www.productbreakfastclub.com/\n\nSign up for our fortnightly newsletter here:\nhttps://pages.convertkit.com/706830c7...\n\nCheck out all the AJ&Smart links here:\nhttps://linktr.ee/ajsmartdesign\n\nFollow us on Instagram: https://www.instagram.com/ajsmartdesign/\n\nWe are AJ&Smart, a design agency based in Berlin. We are crazy about Design Sprints and innovation and we teach everything we know right here on Youtube. If you want to learn more about how to run the best Design Sprint EVER, subscribe and we\''ll help you every step of the way. \n\nDon\''t forget to subscribe to our channel to make all our dreams come true!!\n\nWhat Is UX Design? - A Full Overview\n  \n * What Is UX Design...',20972,681052,1038,'2-Jul-19','AJ&Smart');
