cing with my\n\nDelusion is here again\nAnd I think you\''ll come home soon\nA word brings me right back in\nThen it\''s only me that\''s in this room\nI guess I could just pretend\nThe colours are more than blue\nBut I lost more than my friend\nI can\''t help but missing you\n\nI pictured this month a little bit different no one is ever ready \nAnd when it unfolds you get in a hole\nOh how can it be this heavy?\nEverything changes, nothing\''s the same \nExcept the truth is now you\''re gone\nAnd life just goes on\n\nSo I\''m dancing with my eyes closed\n\''Coz everywhere I look I still see you\nTime is moving so slow\nAnd I don\''t know what else that I can do\nSo I\''ll keep dancing with my eyes closed\nSo I\''ll keep dancing with my eyes closed\nOh I\''ll keep dancing with my\n\nThey\''re shutting the bar\nThey\''re cleaning the floor\nAnd everyone is already home\nBut I\''m on my own\n\nStill dancing with my eyes closed\n\''Coz everywhere I look I still see you\nTime is moving so slow\nAnd I don\''t know what else that I can do\nSo I\''ll keep dancing with my eyes closed\nOh I\''ll keep dancing with my eyes closed\nOh I\''ll keep dancing with my',456099,47816050,14192,'23-Mar-23','Ed Sheeran');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('C7hx-p_NrQM','Live PD: Mama Is Mad (Season 3) | A&E','While on a routine patrol, an officer spots a teenager throwing up on the ground outside a hotel, and in a hotel room, finds many other minors as well as the odor of marijuana in this flashback clip. #LivePD\n\n#LivePD\n\nSubscribe for more from Live PD and other great A&E shows:\nhttp://aetv.us/subscribe-ae\n\nFind out more about Live PD and watch full episodes on our site:\nhttp://aetv.us/LivePDOfficial\n\nCheck out exclusive A&E content: \nWebsite - http://www.aetv.com/\nFacebook: https://www.facebook.com/AETV/ \nTwitter: https://twitter.com/aetv \nInstagram: https://www.instagram.com/aetv \nTikTok: https://www.tiktok.com/@aetv \n\nIn-studio host, ABC\''s Dan Abrams, alongside analyst Tom Morris Jr., guide viewers through the night, giving insight to what audiences see in real time (via a mix of dash cams, fixed rig and handheld cameras), bouncing minute-by-minute between the featured police departments and offering an inside look at each live incident.\n\nA&E leads the cultural conversation through high-quality, thought provoking original programming with a unique point of view. Whether it\''s the network\''s distinctive brand of award-winning disruptive reality, groundbreaking documentary, or premium scripted drama, A&E\''s brave storytelling always makes entertainment an art. Visit us at aetv.com for more info.',718,62603,109,'22-May-23','A&E');
