INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DDW2_jrID3Q','The KV Series - A Complete History Of Russia\''s WW2 Behemoths','In 1938 Soviet tank designers came up with the best heavy tank design in the world - the KV-1. Far from perfect, this 45 ton rolling behemoth would kick start a series of hugely impressive and incredibly influential vehicles, going from the KV-1 all the way up to the KV-14 and beyond. Seeing extensive combat in the Second World War against the invading German army, the KVs would join the T-34 in forming the core of the Red Army\''s modern armoured spearhead, and would be developed further into the iconic IS series. \n\nDISCORD: https://discord.gg/WJzJXkjH3Q\nPATREON: https://www.patreon.com/RedWrenchFilms\n\nChapters:\n00:00 Intro\n01:25 SMK and T-100\n04:02 KV-1\n05:50 KV-2\n07:39 The KV-3 Saga\n11:07 KV-4 and KV-5\n11:52 Baptism of Fire\n14:52 Serious Issues\n17:40 KV-1 Mod. 1941\n18:28 KV-1E \"Ekranami\"\n18:55 KV-1 Mod. 1942\n20:00 KV-13\n21:10 KV-1S \"Skorostnoy\"\n22:05 SU-152 (KV-14)\n23:05 KV-85 and IS\n23:50 KV-6, 7 and 8\n24:45 KV-9, 10, 11 and 12\n25:40 Conclusion\n\nAll content is presented in historical context for educational purposes. All footage is owned by it\''s copyright holder and is used in this channel under \"fair use\".\n\nMusic by Epidemic Sound',8483,189288,588,'12-May-23','Red Wrench Films');
