INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('UQE4EUpED6s','Word Family -ut | Phonics Song for Kids | Jack Hartmann','Learn about the ut  word family.  Word families are groups of words that have a common pattern. Word families, sometimes called phonograms or chunks, can help emergent readers by providing predictable patterns within words.\n\nWhen learning to read, patterns are important.  Children recognize word patterns and this makes it easier to sound out words. \n\nSing and move with Jack as he introduces  the ut word family.  These are words that all end with ut and have different beginning sounds or blends.  \n\nLyrics\nLet\''s learn lots of words in the ut family\nWhen you learn them they can help you write and read\nEach one is different as they begin\nBut they all have  ut at the end\n\nLook and listen and say the word\n\n/c/    ut       cut\n/n/    ut       nut\n/h/    ut       hut\n/sh/  ut      shut\n/b/    ut        but\n \nLet\''s learn lots of words in the  ut family\nWhen you learn them they can help you write and read\n\n/c/    ut       cut\n/n/    ut       nut\n/h/    ut       hut\n/sh/   ut      shut\n/b/    ut        but\n\nWe learned lots of words in the ut  family\nWhen you learn them they can help you write and read\nNow you read the words and say them out loud\n\ncut\nnut\nhut\nshut\nbut\ncut\nnut\nhut\nshut\nbut\n\nWe learned lots of words in the ut family\nWhen you learn them they can help you write and read\nIt\''s fun learning words in the ut family\n\nJack Hartmann\''s website: www.jackhartmann.com\n\nRemember to connect with Jack Hartmann on his Social Networks:\n\nFacebook: www.facebook.com/hop2itmusic\nPinterest: www.pinterest.com/jackhartmann\nYouTube:   \n / jackhartmann  \nTwitter: twitter.com/Jack_Hartmann\nGoogle +: plus.google.com/u/0/111246828015196865180\n\nYou can find Jack Hartmann\''s Music on:\n\nJack Hartmann Website: www.jackhartmann.com\niTunes: itunes.apple.com/us/artist/jack-hartmann/id391057562\nAmazon Mp3: amazon.com/Boom-Chicka/dp/artist-redirect/B0156RBPXW/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1492528781&sr=1-1&keywords=Jack+Hartmann\nGoogle Play: play.google.com/store/music/artist/Jack_Hartmann?id=Ax3xg7dhdt5nx4b47dnwxjnhhhy&hl=en\nCD Baby: www.cdbaby.com/Artist/JackHartmann',1942,376439,0,'21-Jul-17','Jack Hartmann Kids Music Channel');
