INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('TXHjtRR20kM','Le RN est-il devenu un parti comme un autre ? - C Ce soir du 31 mai 2023','Pour voir la suite du debat :point_right: https://bit.ly/NormalisationRN\n\nPour voir d\''autres emissions :point_right: https://bit.ly/CCeSoir\n_________________________________________________________________\nUne question morale, strategique et politique qui s\''invite au plus haut sommet de l\''Etat... D\''un cote, Elisabeth BORNE, qui attaque Marine LE PEN sur l\''heritage petainiste de son parti, de l\''autre Emmanuel MACRON, qui a recadre hier sa Premiere ministre en affirmant qu\''on ne pouvait plus combattre aujourd\''hui le RN avec, je cite, \"les mots des annees 90\"... Alors qui a tort ? Qui a raison ? L\''indignation morale et le rappel de l\''Histoire sont-ils des arguments efficaces pour parler aux electeurs du RN, ou au contraire contre-productifs ? On en debat avec : \n\n:pushpin: Jerome SAINTE-MARIE, Politologue, sondeur, directeur de la societe d\''etudes et de conseil Polling Vox\n:pushpin: Chloe RIDEL, Porte-parole du Parti socialiste\n:pushpin: Christophe DE VOOGD, Historien, professeur affilie a Sciences Po\n:pushpin: Frederique MATONTI, Politologue, professeure de science politique a l\''Universite Paris-I\n:pushpin: Gerard NOIRIEL, Historien, directeur d\''etudes a l\''EHESS, auteur de << Le pourquoi du comment - Mieux vivre grace a l\''Histoire >> aux editions Michel Lafon / France Culture (09.03.2023)\n:pushpin: Thomas LEGRAND, Journaliste et editorialiste politique\n\n\nEt pour ceux qui veulent ecouter l\''emission depuis partout dans le monde OU acceder aux emissions plus disponibles en replay, il y a LES PODCASTS : \n:green_square: Sur Spotify https://spoti.fi/3n6YltP\n:purple_square: Sur Apple https://apple.co/3qTuc2p\n:yellow_square: Sur Deezer https://bit.ly/Deezer-C-Ce-Soir\n:orange_square: Sur Podcast addict https://bit.ly/Podcast-addict-c