INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DFk6aVSWo7s','D-LOW | Grand Beatbox Battle Champion 2019 Compilation','All rounds of D-low at the Grand Beatbox SHOWCASE Battle 2019 in an epic beatbox compilation. Congratulations again for winning this year, you really deserved it!\n\nFollow D-low on Instagram: @dlowbeatboxblad\nFollow Grand Beatbox Battle on Instagram: @grand.beatbox.battle\n\n\nThank you very much to the GBB19 Sponsors:\n\n1) DPA, the microphone sponsor, we love your mics. Check more here:\nhttps://www.dpamicrophones.com/beatbo...\n \n2) Dynaudio, your support and speakers are lovely. Check more here:\nhttps://www.dynaudio.com/swissbeatbox\n\n3) BOSS & Roland, thanks for 7 years of involvement. Check more here: https://www.boss.info\n\n4) V-Moda, thank you for the nice headphones. Check more here:\nhttps://www.v-moda.com/us/en\n\n5) Vochlea, thank you for collaborating. Check more here:\nhttps://www.vochlea.co.uk/\n\n6) Asia Beatbox, thanks Mic Lee & Nela, we love you, thanks Benny from the UK, thanks Trung Bao. Subscribe to Asia Beatbox:\n  \n / @asiabeatbox  \n\n7) Thank you THTC for the nice designs. Check their shop: https://shop.thtc.co.uk/\n\nThe entire beatbox family want to say thanks for your support. It was great to work with you all & we look forward to continuing this fantastic relationship with you.\n\n#beatbox #Dlow #gbb19\n\n--------------------------------\nCheck the full GBB19 SHOWCASE Playlist:\nhttp://bit.ly/GBB19solo\n\nCheck the full GBB19 LOOPSTATION Playlist:\nhttp://bit.ly/GBB19loop\n\nCheck the full GBB19 TAG TEAM SHOWCASE Playlist:\nhttp://bit.ly/GBB19tagteam\n--------------------------------\n \nCheck the most recent upload here: https://goo.gl/9Srrsh\n \nCheck the most popular upload here: https://goo.gl/U7rkYA\n \nCheck our channel & subscribe: https://goo.gl/0CGTrT\n \n___________________________________\n \nCheck out this beatbox albums:\n \nTRANSCEND by Gene Shinozaki: https://swissbeatbox.com/gene_transcend/\n \nCheck the playlist:\nhttp://bit.ly/2IppV3D\n \n \nLIPS by NaPoM:\nhttp://swissbeatbox.com/napom_lips\n \nCheck the playlist:\nhttp://bit.ly/2BKcdCO\n \n___________________________________\n \n \n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nThanks to the involved parties:\n \nThanks Robert Ruszcyk & your team to set up our 11th edition of GBB19 in Warsaw, Poland at Stodola Klub! Thanks Stodola.\nThanks Rob for the whole coordination.\n\nBIG THX TO THE CAM & AUDIO CREW. Thanks to the entire team for doing an amazing production for this years edition.\n \nMadox from SBX, Kazu from humanbeatbox, Adam Andrew Corre from Beatbox Television, David Greuzinger, Luca Saavedra, John Richter, Max Gottert & Dennis Biskup. Your work this year was insane. THANK YOU.\n\nAudio mixed/mastered by Sinjo from SBX & thanks to Kuba, you are a legend! Thanks for the whole live sound & the whole work at the venue. You are legends! THANK YOU.\n \nShoutout to Madox & Sinjo!\n\nThanks Asia Beatbox! Mic Lee is one of the biggest legends.\nThanks Benjamin Williams for the whole help these days.\nThanks Trung Bao for all you did.\nThanks to Juliana, Azel, YasSon and Azel for the big help at GBB.\nThanks to Patchwork and Chmielna hotel for the hospitality.\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n \nENJOY MORE BEATBOXING MOMENTS HERE:\n \n \n-~-~~-~~~-~~-~\nNaPoM | Roll Like This\nhttp://bit.ly/2DVgkfp\n~-~~-~~~-~~-~\n \n~-~~-~~~-~~-~\nNaPoM | Bass Electro\nhttp://bit.ly/2TX0Oq4\n~-~~-~~~-~~-~\n \n~-~~-~~~-~~-~\nGene Shinozaki & Bigman | Get Lucky (Beatbox Cover)\nhttp://bit.ly/2ScBZ81\n~-~~-~~~-~~-~\n \n~-~~-~~~-~~-~\nBERYWAM & MB14 | Crew World Champion\n  \n * BERYWAM & MB14 | ...  \n~-~~-~~~-~~-~\n \n~-~~-~~~-~~-~\nGene Shinzaki | Here You Say\nhttp://bit.ly/2IjYO9Z\n~-~~-~~~-~~-~\n \nCheck out the Playlists from last year\''s GBB:\n \nThe GBB18 LOOPSTATION  Playlist:\nhttp://bit.ly/2IjZs7p\n \nThe GBB18 SHOWCASE Playlist:\nhttp://bit.ly/2GPRpNy\n \nThe GBB18 TAG TEAM Playlist:\nhttp://bit.ly/2T0LeNa\n-------------------------------------\n\nfacebook: https://www.facebook.com/#!/swissbeatbox\ninstagram: http://instagram.com/swissbeatbox\nwebsite: http://www.swissbeatbox.com/\ntwitter: http://twitter.com/#!/swissbeatbox\nsoundcloud: http://soundcloud.com/user-787127965\n                                   \nSwissbeatbox.com provides video clips from professional beatboxers & new talents all over the world, film concerts & battles & has a vision to bring beatbox to another level. swissbeatbox.com is one of the biggest beatbox communities in the world! We publish exclusive beatbox videos, news, battles & merchandise every week!\n \nPlease support us & share this & our other videos on the social networks, press the like button & please leave a comment.\n \nCheck our channel:   \n / swissbeatbox  \n \n \nThanks for your support\nSwissbeatbox.com',289438,19271072,9261,'14-May-19','Swissbeatbox');
