INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('uL8nm3OuqKE','MKE Ankaragucu (1-4) Galatasaray - Highlights/Ozet | Spor Toto Super Lig - 2022/23','Spor Toto Super Lig\''in 36. haftasinda deplasmanda MKE Ankaragucu\''nu 4-1 maglup eden Galatasaray, sampiyonlugunu ilan etti.\n\nEryaman Stadyumu\''nda oynanan mucadelede sari-kirmizililarin gollerini Mauro Icardi (2), Baris Alper Yilmaz ve Sergio Oliveira kaydetti. Baskent ekibinin tek golu ise Milson\''dan geldi.\n\nKarsilasmaya 3 asistle yildizlasan Kerem Akturkoglu damga vurdu.\n\nSuper Lig tarihindeki 23. sampiyonlugunu elde eden Galatasaray, en yakin rakibi Fenerbahce ile arasindaki sampiyonluk sayisi farkini 4\''e cikardi.\n\nGalatasaray\''i Ankara\''da sampiyonluga tasiyan Mauro Icardi, Super Lig tarihinde Galatasaray\''in ust uste 8 golunu atan ilk oyuncu oldu. Arjantinli futbolcu ligdeki gol sayisini 21\''e cikardi.\n\nLigdeki son 5 macinin 4\''unden puan kaybiyla ayrilan MKE Ankaragucu ise haftayi 39 puanla tamamladi.\n\nPremier Lig, Bundesliga ve Ligue 1\''den en ozel icerikler, guncel ozet videolar ve cok dahasi beIN SPORTS Turkiye Youtube kanalinda!\n\nbeIN SPORTS\''un en guncel programlarini, spor dolu iceriklerini takip etmek icin kanala abone olmayi unutmayin: http://dgtrk.lu/1ebhi\n\nSpor Toto Super Lig Ozetleri: http://dgtrk.lu/1ewd4\n\nbeIN SPORTS Arsiv: http://dgtrk.lu/1evqg\n\nBizi sosyal medyada takip edin: \n:pushpin: Facebook: https://www.facebook.com/beINSPORTSTR \n:pushpin: Twitter: https://twitter.com/beINSPORTS_TR \n:pushpin: Instagram: https://www.instagram.com/beinsportstr/\n\n--------------\n\nDaha fazlasi icin:\nEn Cok Izlenen Galatasaray Videolari: https://bit.ly/3H04L90\nEn Cok Izlenen Fenerbahce Videolari: https://bit.ly/3OT03f7\nEn Cok Izlenen Besiktas Videolari: https://bit.ly/3Vv5C66\nEn Cok Izlenen Trabzonspor Videolari: https://bit.ly/3gPlzF7\n\n#superlig #ankaragucu #galatasaray #macozeti #superligozet #beinsportshaber #beinsportsturkiye',4918,265174,404,'30-May-23','beIN SPORTS Turkiye');
