INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DsqqAGNRprs','Cross-Country MTB Grande Finale','> Watch the Full XCO Replay: https://win.gs/ValDiSole22\nOverall titles were up for grabs and history was created in the Cross-Country Short Track (XCC) and the Cross-Country Olympic (XCO) Mercedes-Benz UCI Cross-country Mountain Bike World Cup at the final race of the season in Val di Sole, Italy.\n\nTop 5 Women: \n1. Pauline Ferrand Prevot: 1.20,23\n2. Loana Lecomte: 1.21.50\n3. Jolanda Neff: 1.22,52\n4. Haley Batten: 1.23,41\n5. Sina Frei: 1.25,34\n\nTop 5 Men: \n1st. Titouan Carod: 1.22,02\n2nd. Nino Schurter: +35\n3rd. Jordan Sarrou: +1.08\n4th. Victor Koretzky: +1.27\n5th. Luca Braidot: +1.36\n\nOverall Standings: \n:first_place: Allesandra Keller & Nino Schurter\n:second_place: Rebecca Mcconnel & Titouan Carod \n:third_place: Anne Terpstra & Luca Braidot\n#mtb #mountainbike #crosscountrymtb \n____\nExperience the world of Red Bull Bike like you have never seen it before. With the best bike videos, from Mountain Bike Downhill to Cross Country plus BMX and original series, prepare for your \"stoke factor\" to be at an all time high.\n\nSubscribe to Red Bull Bike on Youtube: https://win.gs/SubToRedBullBike\n\nGet the FREE Red Bull TV apps for all your devices: http://onelink.to/yfbct7\n\nWatch Red Bull TV: https://win.gs/WatchRBTVBike\n\nSee into our world: http://goo.gl/J49U\n\nRed Bull Bike on Facebook: https://win.gs/RedBullBikeFacebook\n\nRed Bull Bike on Instagram: http://win.gs/RedBullBikeInstagram',3921,224157,144,'7-Sep-22','Red Bull Bike');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('CncR2yu89Ac','Just When I Thought It Couldn\''t Get Any Worse! (Ford 8n Repair Gone Wrong)','In this video, I dive into the frustrating world of classic tractor repair as I attempt to fix a 1948 Ford 8N that has not been cranked in years, but I soon realize that it won\''t start after a tune-up and carburetor rebuild. Despite my best efforts, the engine just won\''t turn over, leaving me scratching my head and wondering what to do next.\n\nBut the troubles don\''t end there. As I continue to investigate the old tractor, I discover that the water pump has randomly started leaking, adding yet another layer of difficulty to the repair process. With each passing moment, the situation becomes more and more dire, and we are left wondering if we will ever be able to get this classic tractor back up and running.\n\nJoin me as I navigate through the challenges of repairing this beloved piece of machinery that my grandfather gifted me, and try to solve the mystery of why it just won\''t start. This is a cautionary tale of the unexpected hurdles that can arise during a seemingly simple repair job, and a testament to the resilience and determination of the dedicated farmer who refuse to give up until the job is done.\n\n:relaxed: Brooke\''s New Channel:   \n / @mrscoghillfarm  \n:headphones: Our YouTube Podcast Channel:   \n / @coghillfarmpodcast  \n:shirt: Our Merchandise and Everything Else Cog Hill: https://www.coghillfarm.com/\n-------------\nWelcome To Cog Hill Farm & Homestead: Good wholesome family fun on the farm and homestead!\n\n #familyfarm #farmlife #farmpets #farm #smallfarm #farmliving #farmanimals #farmstead \n\nIf you are just beginning a homestead or just starting out, I hope these homesteading videos & our homestead channel are helpful to you & your Family! \n\n**(Please note that some of the links above are affiliate links, & at no additional cost to you, I will earn a commission if you decide to make a purchase after clicking through the link)**\n---------------\nThanks for watching this episode of life on our family farm!\nY\''all be good,\nJason, Brooke, MaryCarl, Peaches, & Nugget\nCog Hill Farm & Homestead',10270,62868,834,'20-Feb-23','Cog Hill Family Farm');
