INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('_Nawc37HyTQ','The QU Sound | Phonics Video | Scratch Garden','The QU Sound phonics video teaches the correct English pronunciation of the QU letters. \n\nThe QU sound is a very important consonant digraph. Consonant digraphs (also called letter digraphs) are 2 letters that make a new sound when they are put together.  Without the QU sound we wouldn\''t know QUite what QUails or QUirks were!\n\nWhether teaching ESL or learning to read the English language, this video is sure to help you learn English phonics and pronunciation quickly and happily. \n\nMore Scratch Garden Phonics Videos here:   \n * Phonics | Digraphs  \n\nWatch more English language learning videos:   \n * English Learning ...  \n\nWe love to teach with music! Watch Scratch Garden Educational Song Videos here:   \n * Scratch Garden Le...    \n\nScratch Garden makes entertaining educational videos for people that like to laugh and learn! Please Subscribe to see more great fun learning videos from Scratch Garden! https://goo.gl/1biPj\n\nOUR FIRST BOOK IS NOW AVAILABLE! http://amzn.to/2Fm2B0L\n\nWebsite: https://www.scratchgarden.com\nInstagram: https://www.instagram.com/scratchgarden\nFacebook: https://www.facebook.com/scratchgarden',2703,794176,0,'27-Aug-18','Scratch Garden');
