INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('RMHPAj4cxMc','2022 Golf R vs BMW M240i vs Audi S3 // DRAG & ROLL RACE','The 2022 BMW M240i xDrive ($56,950 CAD starting, $48,550 USD starting), the 2022 Volkswagen Golf R ($44,995 CAD starting, $43,645 USD starting), and the 2022 Audi S3 ($47,900 CAD starting, $44,900 USD starting) are lined up on the Throttle House drag strip. Just like an off-the-cuff drag race, our film days don\''t always go as planned. This one ran a little long due to several unforeseen hiccups, so we apologize in advance for the dark and ominous mood lighting. As for the race, each car is equipped with all-wheel drive and launch control - but only one can cross the finish line first! Watch to see what happens! SUBSCRIBE!\n\nThank you to Saad and the team at Audi Queensway for letting us feature their Audi S3. Check out their inventory here! https://www.audiqueensway.ca/en\n\nEXTRA THROTTLE HOUSE!\n  \n / extrathrottlehouse  \n\nInstagram! \nhttps://www.instagram.com/thethrottle...\n\nFacebook! \nhttps://www.facebook.com/ThomasHollan...\n\nPost-production by D\''Nyeal Wilson and Karston Chong and Thomas Holland\n\nMusic from Epidemicsound.com and Artlist.io\n\n#M240i #AudiS3 #GolfR',16712,565844,971,'9-Dec-21','Throttle House');
