INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('6vXePQi_MAk','Is the Kia EV9 the best full-size EV SUV?','This is our in-depth review of the Kia EV9, the new large electric SUV. We are comparing Kia EV9 GT-Line 6-seater vs Kia EV9 base 7-seater. We\''re taking a look at Exterior, Interior and technology.\n\n>Follow us on Instagram @autogefuehl and @thomas.letsgo\n>Subscribe here: https://www.youtube.com/user/autogefu...\n\n00:00 Kia EV9 GT-Line in matt blue\n01:28 Length and RWD or AWD\n02:22 Frunk and battery kWh sizes \n02:53 EV9 base in Silver \n03:58 Interior GT-Line\n08:16 Rear 6-seater swivel seats\n10:34 3rd seating row\n11:02 Trunk / boot 6-seater\n11:48 Base interior in grey\n13:31 Rear 7-seater bench \n15:40 7-seater trunk / boot\n16:33 Is it the best large EV?\n\n#Kia #KiaEV9\n\nTransparency note: Autogefuhl videos are independent and free from editorial influence on opinion and rating. But since manufacturers enable us to do the reviews in the first place, for legal reasons this video is marked as _advertisement_.\n\nWATCH OUT FOR SPAM/FAKE ACCOUNTS. Across YouTube/Whatsapp/Telegram etc., you\''ll find fake accounts taking the identity of original channels or people claiming to work on the behalf of original channels, they sometimes even use the same profile pic, similar names and include a telephone number in the name or their comments, trying to get you to message them on Whatsapp or Telegram. DO NOT MESSAGE THEM, they are trying to get your personal details, bank accounts etc. and in the end, they will ask for money or they will misuse your bank account. They promise you giveaways, prices, payment etc. Do not fall for these cheap tricks and PLEASE HELP everyone and MARK THEIR MESSAGES and their whole accounts/channels as Spam and/or report their telephone numbers/Whatsapp to the police. We from Autogefuehl will never ask for your bank details. Check out our original channel marked with the verified badge.\nWe do have other official channels, so you can identify them and also subscribe if you like e.g. in your native language:\n2nd channel for shorter reviews: \n  \n / autogefuel   \nSpanish: Auto Sensacion - Prueba de coches a fondo\n  \n / @autosensacion  \nArabian: hs lsyrt\n  \n / @autogefuehl_arabia  \nKorea: OToSenSeu\n  \n / @autosensekorea  \nJapan: ka fuiringu\n  \n / @car-feeling  \nRussian: Anatomiya Avtomobilya\n  \n / %d0%90%d0%bd%d0%b...  \nChinese: CheZhiGan\n  \n / @autogefuhlchinese  \nBMW theme channel:\n  \n / @onlybimmers-  \nEV theme channel: \n  \n / @only_ev  \n\n>FULL REVIEWS 2023 Q1\n  \n * EV SUV surprise! ...  \n>FULL REVIEWS 2022 Q4\n  \n * Mercedes C-Class ...  \n>FULL REVIEWS 2022 Q3\n  \n * FULL REVIEWS 2022 Q3  \n\nHow to support Autogefuhl?\n>Subscribe, activate notifications (bell symbol) and bookmark our direct channel: http://www.autogefuehl.com\n>Support us on Patreon: http://www.patreon.com/autogefuehl\n>Exclusive supporter: Ajlan Saeed\n\nWhat is Thomas wearing?\n> Noah shoes https://www.noah-shop.com/\nAutogefuhl viewers get a 20 % shoe discount with the following code: Autogefuehl-20\n\nSocial Media & Blog\n>Facebook: http://facebook.de/autogefuehl\n>Twitter: https://twitter.com/autogefuehl\n>Instagram: https://instagram.com/autogefuehl/\n>Instagram: https://instagram.com/thomas.letsgo/\n>German Blog: http://autogefuehl.de\n\nAutogefuhl is your no. 1 resource for in-depth car reviews and your no. 1 community to discuss cars. Each year we present you 150 cars from every segment and from a wide range of brands. If you have any suggestion, just write a comment or contact us on our other socials. Even if you have further remarks, just let us know.',1941,85938,301,'29-May-23','Autogefuhl');
