INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('OEW4-Sfyvik','pH, pOH, H3O+, OH-, Kw, Ka, Kb, pKa, and pKb Basic Calculations -Acids and Bases Chemistry Problems','This acids and bases chemistry video tutorial provides a basic introduction into the calculation of the pH and pOH of a solution.  This video explains how to the calculate the hydronium ion [H3O+] and the hydroxide ion [OH-] concentration given the pH or the pOH of the solution.  This video contains the formulas and equations needed to calculate Ka and Kb using Kw as well as the pKa and pKb of acids and bases.  This lesson contains plenty of examples and practice problems.\n\nFull 2 Hour Video - Acids & Bases - pH Calculations:\nhttps://bit.ly/3io4Edv\n\nPrintable PDF Worksheet With 19 Questions on Patreon:\nhttps://bit.ly/3k4AQCV\n\nAcids and Bases - Practice Test:\nhttps://bit.ly/3QH4nzb\n\nPDF Worksheet - 60 Test Questions:\nhttps://bit.ly/3Zl6ZXc',18940,1344015,503,'27-Nov-17','The Organic Chemistry Tutor');
