INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('nWNzeCiQBvM','Alfa Romeo 8C Competizione drive review','The Alfa 8C is one of the most desirable Alfas ever created. Powered by a 450bhp, 4.7litre V8 and with a curvaceous body created out of carbon-fibre but what\''s it like to drive? Find out here..\nMany thanks to https://classicmotorhub.com for the loan of this car, where it is just gone up for sale. \nThis video was created with the support of:\nhttp://www.footmanjames.co.uk/\nhttp://www.classicandsportsfinance.com/\nFollow me on Twitter @harrym_vids & @harrysgaragevids on Instagram',12199,809289,1245,'6-Nov-18','Harry\''s garage');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('l3QSyVlQYCg','Wendy\''s Piggy Bank Adventure: Maddie and Eric Learn to Save Money','In a fun-filled adventure, Wendy, our smart and responsible young friend, teaches her pals, Maddie and Eric, the importance of saving money.\n\nThe story begins in Wendy\''s room, where she diligently deposits coins into her piggy bank. She spots Maddie in a toy store about to spend all her savings on toys. Wendy steps in, reminding Maddie about the backpack she needs, leading to a quick fix by the seller that doesn\''t quite hold up. Wendy gifts Maddie her own piggy bank to start saving for a new backpack.\n\nNext, we find Eric at a candy store, eyeing a candy vending machine. Wendy once again swoops in, cautioning Eric about spending frivolously. She shows him her piggy bank, encouraging him to save money. After a surprise dentist visit revealing Eric\''s bad tooth, he too starts saving coins in a piggy bank, thanking Wendy for her advice.\n\nWhen Wendy catches Maddie and Eric at the circus ready to spend their savings, she gently stops them, reminding them about their needs - Maddie\''s backpack and Eric\''s dental care. Maddie then buys her new backpack using the savings from her piggy bank.\n\nAfterwards, when the kids sadly pass by the fun circus games, Wendy finds a way to bring joy while sticking to her saving mantra. She checks their piggy banks and takes out just a few coins for them to enjoy the circus, making sure they save the rest. The video ends with Wendy reminding her friends, and the audience, about the importance of saving money.\n\nSubscribe for notifications to new videos:   \n / @toysandcolors  \n\nCheck out our latest videos playlist:   \n * Emma & Jannie Pre...',1266,425491,0,'28-May-23','Toys and Colors');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('I0JJIobo-N8','THE NEW i5','Introducing THE NEW BMW i5. For the first time, this eight generation 5 Series is digital, dynamic and with all-electric drive. This new edition has a distinctive design; a clean and modern reinterpretation of the characteristic 5 Series look. \n\nOn the inside, interior technology is the focus, with BMW Curved Display for an advanced, driver-focused cockpit experience. Other interior touches include a redesigned steering wheel, optional BMW Interaction Bar and for the first time on a BMW, a completely vegan interior. \n\nWhat do you love most about THE NEW i5? \n\n#THENEWi5 #BMWi5 \n__\nBMW i5 eDrive40*: Combined power consumption: 18.9-15.9 kWh/100 km. Combined CO2 emissions: 0 g/km. Electric range: 497-582 kilometers. All data according to WLTP. * Preliminary data; no homologation figures available yet. Further info: www.bmw.com/disclaimer\n\nOfficial data on fuel consumption, CO2 emissions power consumption and electric range were determined inaccordance with the mandatory measurement procedure and comply with Regulation (EU) 715/2007 valid at the time of type approval. In case of a range, figures in the NEDC take into account differences in the selected wheel and tire size; figures in the WLTP take into account any optional equipment.\n\nWLTP values are used for assessing taxes and other vehicle-related charges that are (also) based on CO2 emissions, as well as for the purposes of vehicle-specific subsidies, if applicable. Where applicable, the NEDC values listed were calculated based on the new WLTP measurement procedure and then converted back to the NEDC measurement procedure for comparability reasons. For more information on the WLTP and NEDC measurement procedures, see www.bmw.de/wltp.\n\nFor further information about the official fuel consumption and the specific CO2 emission of new passenger cars can be taken out of the \"handbook of fuel consumption, the CO2 emission and power consumption of new passenger cars\", which is available at all selling points and at https://www.dat.de/co2/.',3336,154558,502,'24-May-23','BMW');
