INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('eWLVBP3VrO4','432 Hz - Deep Healing Music for The Body & Soul - DNA Repair, Relaxation Music, Meditation Music','432 Hz - Deep Healing Music for The Body & Soul - DNA Repair, Relaxation Music, Meditation Music\n\n:pray: Namaste, \nMeditation and Healing is a YouTube channel which serves you the best meditation, healing, relaxing and sleep music. Our music is composed with different kinds of instrument blending with 432Hz, 528Hz, solfeggio frequencies. This channel was created in 8th December 2014 with an aim of providing digital space for those who are going through stress, anxiety, insomnia and depression. Our music are composed with beautiful piano, flute melody, soothing pads, relaxing bells and many more. They include relaxing music that will help you to relief stress. Or relief yourself from negative feelings like anxiety and help to enhance positive energy in you. It can also give your meditation techniques a boost if you use this type of soothing music as you meditate. It can also have healing capacity where you will learn how to find inner peace and heal yourself within with the capability of music. Our music combined with soothing pads and melody helps people overcome their stress and anxiety. We have been using a precise professional music production and recording software in order to provide you the best audio quality and audio experience. Most of the music in this channel is composed with the combination of soothing pads with piano, flute and bell with the sound of nature. To enhance our music experience for you, we also add the video with the moving graphics and animation editing them in our own sense of flair. We hope to create and present more relaxing and meditative music in the future. Thank you and have a great time.\n\n:pray: Follow on: \n:arrow_forward: Facebook: https://www.facebook.com/Meditation-a...\n:arrow_forward: Website: http://meditationhealingmusic.com/\n:arrow_forward: Twiter: https://twitter.com/MeditationandH2\n:arrow_forward:  YouTube:   \n / @meditationandhea...  \n\n:notes: Download & stream my music from the following sources: \n:arrow_forward: iTunes: https://itunes.apple.com/ca/artist/pr...\n:arrow_forward: Spotify: https://open.spotify.com/artist/4hgD8... \n:arrow_forward: CdBaby: https://store.cdbaby.com/Artist/Prabi...\n:arrow_forward:Amazon: https://www.amazon.com/s?k=Prabin+Dan...\n:arrow_forward: deezer: https://www.deezer.com/en/artist/1231...\n\n:arrow_forward: Recommended Playlist:\nHealing Music for The Body & Soul: https://www.youtube.com/playlist?list...\nPositive Energy Meditation Music:   \n * POSITIVE ENERGY M...  \n432 Hz Meditation:   \n * 432 HZ MEDITATION  \nDeep Sleep Music:   \n * DEEP SLEEP MUSIC  \nRelaxing Music:   \n * RELAXING MUSIC  \n\n:boy: About Me: \nMy name is Prabin Dangol, a music composer and a sound designer. I have been composing music for almost 15 years on various genre. My moto is simply to spread positive energy and thoughts all over the world. My music generally helps to enhance positive energy and relax mind body. If you love my work, I request you to connect with me by subscribing to my Meditation & Healing or Transformation & Miracle Channel. \n\n:boy: More about me: http://meditationhealingmusic.com/about/ \n\n:arrow_forward: Device & Program Information:\n- Digital Audio Workstation (DAW) \nCubase, Propeller head Reason\n- Video Production: \nAdobe Premiere & After Effects 2020 \n\n- Camera: \nCANON EOS M2 \n\n- Master keyboard:\nYamaha P-45, Yamaha PSR EW 400\n\n- Studio Monitor: \nYamaha HS 8 & Audio-Technica ATH-M50x Professional Studio\n\nAll images and video contained are used in strict compliance with the appropriate permissions and licenses required from https://shutterstock.com and/or https://videoblocks.com in accordance with the YouTube Partner Program, Community guidelines & YouTube terms of service.\n\nUnauthorized copying, selling, re-uploading and sampling are strictly prohibited. \nCopyright c 2020 Meditation and Healing by by Prabin Dangol. \nAll Rights Reserved.',316973,38052431,18470,'16-Mar-16','Meditation and Healing');
