INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('jVv3A3t2DBI','What Does a QA Engineer Actually Do?','#PeopleInTech #QA #testing\nWhat does a QA Engineer actually do? \n\nQA Engineers are responsible for ensuring that the software and web applications we use every day work flawlessly. They test and automate tests to make sure everything works as it should- from the buttons on a website to the code that makes it all run. \n\nBut what does that mean for you, the average person? In this video, we take a look at what a QA Engineer\''s job looks like day-to-day, and how you can become one too!\n\n:red_circle: Subscribe for more tips just like this:   \n / @calebking3  \n\n\n-------------------------------SOCIAL-------------------------------\n:bird:Twitter: KingCaleb3',944,36540,35,'2-Mar-22','People In Tech');
