INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('MOoMKCZRDP8','O\''Kenneth, Reggie - PA! (feat. Thywill & City Boy)(Official Video)','On the sequel to 2020\''s Straight Outta Kumerica,\nAsakaa frontmen Reggie and O\''Kenneth give a new\ninterpretation to Ghanaian chill as they rap faux-softly\nabout life\''s little pleasures in Twi, English, pidgin and\nHausa. They also cover the complex story of their\nbackground growing up in Kumasi, Ghana\''s second-\nbiggest city and the spiritual home of Asakaa drill music.\nOfficial Music Video For \"PA\" By O\''Kenneth and Reggie\nFeaturing Thywill and City Boy\nDirected By YawPhanta\n\nSTRAIGHT OUTTA KUMERICA 2 link : https://music.apple.com/\ngh/album/stra..\n\nSocial Media Handles\n\nREGGIE\nInstagram: https://instagram.com/1reggie_osei\nTwitter: https://twitter.com/reggieosei3\nFacebook: https://facebook.com/ReggieOsei3\n\nO\''KENNETH \nInstagram: https://instagram.com/ygaokenneth\nTwitter: https://twitter.com/ygaokenneth\n\nTHYWILL\nInstagram: https://instagram.com/thywillofgod?ig...\nTwitter: https://twitter.com/thywill_ofgod?s=2...\n\n\nCITY BOY\nInstagram: https://instagram.com/cedicityboy\nTwitter: https://twitter.com/cedicityboy',3524,56260,179,'9-Sep-22','O\''Kenneth');
