INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('HxisGutbCF0','Fi - 1. Fragman','Fi\''yi puhutv\''den takip edin, tum fragman, tanitim ve bolumleri ilk siz izleyin > https://puhutv.com/fi-detay?utm_mediu...\n\nAy Yapim\''in yapimciligini ustlendigi, yonetmen koltugunda Mert Baykal\''in oturdugu, puhutv\''nin orijinal dizisi \"Fi\" 31 Mart\''ta izleyicileriyle bulusacak!\n \nAzra Kohen\''in cok satan \"Fi-Ci-Pi\" uclemesinden yola cikarak Nuket Bicakci tarafindan senaryolastirilan, basrollerinde Serenay Sarikaya, Ozan Guven, Berrak Tuzunatac, Mehmet Gunsur ve Busra Develi\''nin yer aldigi Fi, yaklasik 60 dakikalik bolumleri ile puhutv de!\n \nFi, tutkunun pesinden kosanlarin, yanma pahasina atese ucanlarin ve acidan gecerek suregelen yasama karsi dik duranlarin hikayesidir.\n \nBir adam bir kadini sevmis ve dunya degismis. Ama aski degilmis hayati boylesine kokten degistiren, askina ulasabilmek icin cesaret edebildikleriymis. O bir tek kisiye duydugu askin acimasizliginda oylesine buyuk firtinalar baslatmis ki, sonunda, dokundugu her seyi yikmis.\n \nVe bazen...\n \nHayatin kendini yenilemesi icin once her seyin yikilmasi sartmis.\n \nFi, 31 Mart\''ta puhutv\''de.',23759,5277867,1498,'17-Mar-17','puhutv');
