 Baclaran\n\''Wag magmakaawa wala kang mapapala\nWala na \''kong balak magbalik at lumuha\n\nImposible, imposible\nSa pelikula lang yan nangyayari\nAng simple, ganun lang kasimple\nHinding-hindi mabubura ang nangyari\nParang ayoko na\nAyoko na ata, ayoko na nga\nAyoko na ata, ayoko na nga\nAyoko na ata, ayoko na nga sa\''yo...\nImposible, imposible ang hinihiling mo...\n\n[Shanti Dope:]\nKamusta? Alam kong ayaw mo ko kausapin\nSalitang ako\''t ikaw bulong na lang sa hangin\n\''Di pa tamang panahon \''to para usisain\nKatotohanang hindi na bago sa\''yo pag inamin\nSinasalo mo lang ako kahit alam mo\nNa \''di ikaw yung babaeng dapat ginaganto\nKaso lang mukhang pagod ka na kakaunawa\nPanahon na din yata maalalang \''di na ko bata\nPara makipaglaro ng damdamin sa katulad mo\nPaglayo na lang ba yung sagot sa pagkukulang ko\nSiguro nga hindi pa ko handa tumaya\n\''Di ka lang maniniwala pag sinabing \''di sadya\n\n[KZ:]\nImposible, imposible\nSa pelikula lang yan nangyayari\nAng simple, ganun lang kasimple\nHinding-hindi mabubura ang nangyari\nParang ayoko na\nAyoko na ata, ayoko na nga\nAyoko na ata, ayoko na nga\nAyoko na ata, ayoko na nga sa\''yo...\nImposible, imposible ang hinihiling mo...\n\nImposible, imposible ang hinihiling mo...\n\nSubscribe to the Star Music channel!\nhttp://bit.ly/StarMusicPHChannel\n\nVisit our official website!\nhttp://starmusic.abs-cbn.com\n\nConnect with us on our Social pages:\nFacebook:\nhttps://www.facebook.com/starmusicph\nTwitter: \nhttps://twitter.com/StarMusicPH\nInstagram:\nhttp://instagram.com/starmusicph\n\nFor licensing, please email us at: mystarmusicph@gmail.com\n\nCopyright 2019 by ABS-CBN Film Productions, Inc. All Rights Reserved.\n\n#KZxShantiDope #Imposible #StarMusic',118242,9167182,5093,'14-Jun-19','ABS-CBN Star Music');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('MR5XSOdjKMA','Baa Baa Black Sheep | CoComelon Nursery Rhymes & Kids Songs','It\''s bath time for the sheep!  But we\''ll have to catch him first!  Sing along with this familiar nursery rhyme!\nhttps://www.youtube.com/c/Cocomelon?s...\n\nLyrics: \n\nBaa Baa black sheep, have you any wool?\nYes sir, yes sir, three bags full.\nOne for the master, one for the dame\nOne for the little boy who lives down the lane\nBaa baa black sheep, have you any wool?\nYes sir, yes sir, three bags full.\n\nBaa Baa blue sheep, have you any wool?\nYes sir, yes sir, three bags full.\nOne for the master, one for the dame\nOne for the little boy who lives down the lane\nBaa baa blue sheep, have you any wool?\nYes sir, yes sir, three bags full.\n\nBaa Baa pink sheep, have you any wool?\nYes sir, yes sir, three bags full.\nOne for the master, one for the dame\nOne for the little boy who lives down the lane\nBaa baa pink sheep, have you any wool?\nYes sir, yes sir, three bags full.\n\nBaa Baa white sheep, have you any wool?\nYes sir, yes sir, three bags full.\nOne for the master, one for the dame\nOne for the little boy who lives down the lane\nBaa baa white sheep, have you any wool?\nYes sir, yes sir, three bags full.\n\nAbout Cocomelon:\n\nWhere kids can be happy and smart!\n\nAt Cocomelon, our goal is to help make learning a fun and enjoyable experience for kids by creating beautiful 3D animation, educational lyrics, and toe-tapping music. \n\nKids will laugh, dance, sing, and play along with our videos, learning letters, numbers, animal sounds, colors, and much, much more while simply enjoying our friendly characters and fun stories.\n\nWe also make life easier for parents who want to keep their kids happily entertained, giving you the peace of mind that your children are receiving quality educational content.  Our videos also give you an opportunity to teach and play with your children as you both watch!\n\nWEBSITE: http://www.Cocomelon.com\nFACEBOOK: https://www.facebook.com/Cocomelonkids\nINSTAGRAM: https://www.instagram.com/cocomelon_o...\nTWITTER: https://www.twitter.com/Cocomelonkids\n\n\nCopyright (C) Treasure Studio, Inc. All rights reserved.',9195412,3652751307,0,'25-Jun-18','Cocomelon - Nursery Rhymes');
