INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('G3t1CnjaBf4','Entity Paradigm (EP) _ Waqt (Time) - Pakistani Band','Band: Entity Paradigm (EP)\nSong: Waqt (Time)\nLanguage: Urdu\nCountry: Pakistan\n\nLineup:\n~Current~ \nFawad Afzal Khan - vocals, backing vocals (2000-2007, 2009-present) \nAhmed Ali Butt - vocals, backing vocals, keyboards (2000-2007, 2009-present) \nSalman Albert - lead guitar, drums, backing vocals (2000-2007, 2009-present) \nWaqar Ahmed Khan - drums (2000-2007, 2009-present) \nHassaan Khalid - rhythm guitar, bass guitars (2000-2007, 2009-present) \n\n~Former~\nAbid Khan - bass guitars (2000) \nZulfiqar Jabbar Khan - lead guitars, vocals (2000-2007) \nSajjad Ali Khan - bass guitars (2000-2007)\n\nAbout Entity Paradigm (EP):\nEntity Paradigm (also known colloquially as [E.P]) is a rock music band from Lahore, Pakistan, formed by Fawad Afzal Khan (vocals) and Ahmed Ali Butt (keyboards). Entity Paradigm is one of the pioneer mainstream rock bands in the Pakistani music industry, and its music. Musically, Entity Paradigm are heavily influenced by Tool, and Linkin Park, amongst other Western music rock artists.\n\nThe band disbanded in 2007 and on March 12, 2009 Entity Paradigm announced their official comeback with Fawad Khan and Ahmed Ali Butt in leading positions. However, two of the main members of the band, Zulfiqar J. Khan and Sajjad A. Khan, decided not to make a comeback due to work on different projects.',7751,912444,627,'8-May-09','Desi Rock Metal');
