INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('MT1rqMIj7_U','May xuc cau da nang don duong cho xe o to ben, xe Lightning McQueen | Be ca o to do choi','Tom Tat Noi Dung Video:\nNgay xua ngay xua, co mot chiec xe ben cho cat dang tren duong di thi gap mot doan duong bi da chan ngang. Chiec xe tai duoc xac dinh da co gang di qua nhung khong thanh cong, can duoc ho tro. No keu goi mot chiec may xuc da nang den don da va cung nhau xay dung mot cay cau.\n\nMay xuc den kip thoi, san sang cho thu thach. Nhung canh tay manh me cua no vung vao hanh dong, pha vo nhung tang da va don duong. Bang su chinh xac va suc manh, chiec may xuc da don sach chuong ngai vat, tao loi di thong suot cho xe tai. Khi nhung tang da da duoc don sach, ho bat tay vao xay dung mot cay cau chac chan va dang tin cay.\n\nMay dao can than dinh vi cac vat lieu nang, trong khi xe tai do hang cat de su dung cho phan mong. Ho lam viec hai hoa, nhung no luc cua ho bo sung cho nhau. May xuc da kheo leo dieu khien nhung tang da, xay dung mot cau truc vung chac, trong khi xe tai cung cap cac vat lieu can thiet de cung co su on dinh cua cay cau.\n\nKhi cay cau hinh thanh, su hop tac giua xe tai va may dao ngay cang manh me. Tinh than dong doi cua ho the hien suc manh cua su doan ket va giai quyet van de. Bat chap tro ngai ban dau, ho van kien tri, the hien quyet tam va su thao vat trong viec tim ra giai phap.\n\nThong qua cau chuyen nay, tre em co the hoc duoc suc manh cua tinh than dong doi va cach ket hop cac suc manh va ky nang khac nhau de dat duoc thanh cong. No khuyen khich ho don nhan nhung thach thuc va tiep can chung voi mot tu duy tich cuc va hop tac. Cuoi cung, cau chuyen tham nhuan niem tin rang voi su doan ket va quyet tam, bat ky tro ngai nao cung co the vuot qua va nhung cay cau co the duoc xay dung theo ca nghia den va nghia bong.\n\nTong hop video do choi hay nhat: https://by.com.vn/VBB8b\n\n#forkids #cars #toys #excavator #truck\n\nTrang web: http://funtime.media\nFacebook: https://www.facebook.com/funtimemedia...\nTwitter: https://twitter.com/funtime_media\n\n\nBan quyen (C) Cong ty Co phan Funtime Media Corp.',115,24830,0,'1-Jun-23','Be Ca Do Choi');
