INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('SCTCiqEW07k','The Best Stretch For Your QL (Quadratus Lumborum) | Tim Keeley | Physio REHAB','#ql #backpain #mobility\n\nMany different types of lower back stretches out there for you QL, but I find this one is the best to target the QL, as well as some lumbar extensors and obliques.\n\nThe key with this stretch is to work on all three components: flexion, rotation, side flexion and all the while trying to take out the hamstring and sciatic nerve component so you can focus on the lower back mobility. I also have a trick for those of you who are really tight and find it different to balance holding your foot.\n\nIt\''s a great stretch foe you lower back pain and tightness so if you\''re doing something different - try this and I am sure you\''ll thank me!\n\nHappy stretching!\n\nPhysio Fitness | Physio Rehab\nhttps://bit.ly/physio-links',1502,58353,123,'9-May-22','Physio Fitness | Physio REHAB | Tim Keeley');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('QRc8sEd46lg','Hidradenitis Suppurativa (HS) | Pathophysiology, Triggers, Signs & Symptoms, Diagnosis, Treatment','Hidradenitis Suppurativa (HS) | Pathophysiology, Risk Factors & Triggers, Signs & Symptoms, Diagnosis, Treatment\n\nHidradenitis suppurativa is a chronic inflammatory skin condition characterized by recurrent inflammatory skin lesions (including nodules, abscesses, etc.) that affect particular areas of the body (ex. arm pits, groin). Hidradenitis suppurativa has particular associated risk factors for development of skin lesions, including genetics, smoking and obesity. In this lesson, we discuss risk factors and triggers for this condition, along with signs and symptoms, methods to diagnosis and ways to treat it.\n\nI hope you find this lesson helpful. If you do, please consider liking & subscribing to help support this channel!\n\nREFERENCES:\nHidradenitis Suppurative, StatPearls\nhttps://www.ncbi.nlm.nih.gov/books/NB...\n\nPlease donate to help support this channel (and get ACCESS TO EXCLUSIVE VIDEOS) > https://www.patreon.com/jjmedicine\n\nSubscribe for more free medical lessons   \n / @jjmedicine  \n\n**MEDICAL DISCLAIMER**: JJ Medicine does not provide medical advice, and the information available on this channel does not offer a diagnosis or advice regarding treatment. Information presented in these lessons is for EDUCATIONAL PURPOSES ONLY, and information presented here is NOT TO BE USED as an alternative to a healthcare professional\''s diagnosis and treatment of any person/animal. \n\nOnly a physician or other licensed healthcare professional are able to determine the requirement for medical assistance to be given to a patient. Please seek the advice of your physician or other licensed healthcare provider if you have any questions regarding a medical condition. \n\n----------------------------------------------------------------------------