INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('sQPWKwlxvMo','Decreasing Frictions in DeFi Hackathon - Opening Ceremony','0x, Family, Polygon Labs, and AWS are excited to invite you to participate in our \"Decreasing Frictions in DeFi\" Hackathon, an online hackathon where builders can showcase their innovations to solve real-world financial frictions.\n\nSubscribe to the 0x YouTube channel to get notified when we upload workshops to this playlist!\n\nPRIZES: The hackathon is offering a total of $30,000 worth of awards ($10,000 USD +$20,000 AWS credits).\n\nIn addition to prizes, 0x is providing an opportunity for top 3 winners to showcase their project on our marketing channels. This is an exclusive opportunity to gain exposure and propel projects to the next level.\n\nWORKSHOPS: We\''ll be hosting three workshops during the entire hackathon month. Find the dates and links: https://dorahacks.io/hackathon/decrea...\n\nTIMING: Submissions are open from June 2nd thru July 2nd, 2023. Judging is from July 3rd to July 7th. Winners will be announced July 10th.\n\nFULL HACKATHON DETAILS https://dorahacks.io/hackathon/decrea...\n\n---\n\nHOW TO JOIN \nStep 1: Read through the Requirements (https://dorahacks.io/hackathon/decrea...)\n\nStep 2: Join 0x Discord and coordinate in #defi-2023-hackathon channel (https://discord.com/invite/official0x)\n\nStep 3: Fill out the signup form (https://forms.gle/8mYh1GBnb3EBiyQF8)\n\nStep 4: All team members should register on DoraHacks (https://dorahacks.io/hackathon/decrea...)\n\nStep 4. Attend the workshops, and build your projects (https://dorahacks.io/hackathon/decrea...)\n\nStep 5: Submit your entry with all teammates included via DoraHacks based on the Submission Requirements and Judging Criteria (https://dorahacks.io/hackathon/decrea...)\n\n---\nLOOKING FOR A TEAM? \n\nAsk in the #defi-2023-hackathon channel in the 0x Discord: https://discord.com/invite/official0x\n\n--\nQUESTIONS? \n* Ask on the Idea Board page (make sure to register as Hacker) https://dorahacks.io/hackathon/decrea...\n* Or contact DoraHacks user support account at Telegram @dorahacksofficial',8,54,1,'2-Jun-23','0x');
