INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('_gkVISZFwZU','Taarak Mehta Ka Ooltah Chashmah - Episode 76 - Full Episode','Click here to subscribe to Taarak Mehta Ka Ooltah Chasmah Episodes:   \n / @taarakmehtakaool...  \n\nEpisode 76 - \n-------------------\nIt is Tapu\''s wedding day and everybody is dressed as they are the \''baraatis\''. Baapuji is the happiest and is proudly celebrating Tapu\''s wedding.\n\nAbout Taarak Mehta Ka Ooltah Chashmah:\n----------------------------------------------------------------------\nThe show is inspired from the famous humorous column \''Duniya Ne Oondha Chashma\'' written by the eminent Gujarati writer Mr. Tarak Mehta. This story evolves around happenings in \"\"Gokuldham Co-operative Society\"\" and covers topical issues which are socially relevant. The show predominantly - revolves around Jethalal (Dilip Joshi) who is an uneducated Gujarati businessman. Tarak Mehta (Sailesh Lodha), is his neighbor. Jethalal finds a friend and philosopher in Tarak Mehta and often goes to him for advice whenever he is in trouble. Jethalal\''s family includes his simpleton wife Daya Ben (Disha Wakani) and a mischievous son Tapu (Bhavya Gandhi). Tapu is a menace and a constant source of trouble to all the members residing in the Gokuldham Society. They have often warned Jethalal to reform Tapu or else be prepared to leave the premises. Lost hopes of being heard by',19315,2229308,504,'22-Oct-20','Taarak Mehta Ka Ooltah Chashmah Episodes');
