INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('Rn5CatbKrkM','Nikon Z8 Final Review: What\''s the Catch?','We were very impressed with the Nikon Z8 when it was first announced, but now we have a production model to really test things like buffer, overheating and image quality. Is this Nikon best in class, or have there been too many compromises made to get the size and price down? Chris and Jordan have the answers!\n\nRental equipment provided by The Camera Store\nhttp://www.thecamerastore.com\n\n0:00 - Intro\n1:14 - Autofocus\n2:31 - Buffer\n4:34 - Battery life\n5:22 - Missing Z9 features\n6:40 - Puppy!\n7:15 - Image quality\n8:07 - EVF\n9:24 - Video performance\n12:25 - Who is it for?',4521,63109,325,'3-Jun-23','PetaPixel');
