INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('1KaLu1T017M','Samsung Galaxy J8 - In-depth Review and Specifications (2018)','Galaxy J8 Full review, camera samples, gaming performance and more...\nSubscribe to Mobiscrub:\nhttp://bit.ly/subscribe-mobiscrub\n\nSamsung Galaxy J8 Price in India: INR 18,990 (64 GB) \n\nSamsung Galaxy J8 specifications:\n\nOS: Android 8.0.0 Oreo\nProcessor: Snapdragon 450 1.8 GHz Octa-core\nDual SIM: Yes\n4G ready: Yes\nExternal memory: Yes, microSD up to 256 GB\nRAM: 4 GB\nMemory: 64GB\nCamera: 16MP f/1.7 + 5MP f/1.9, autofocus, LED flash\nVideo: 1080p@30fps\nFront camera: 16 MP, f/1.9, with LED flash\nBattery: 3,500 non-removable\nDisplay: 6 inches, Super AMOLED\nScreen resolution: 720 x 1480 pixels\nBluetooth: Yes, v4.0\nFingerprint: Yes\nBody design: Unibody, polycarbonate\nCharging port: microUSB 2.0\nFM Radio: Yes\nVideo on chat - Yes\nWaterproof or Water resistant: No\nNotification LED: No\n\nGalaxy J8 display\n\nA massive 6 inch super AMOLED display with a resolution of 720 pixels by 1480 pixels that lends the device a fluid 18.5:9 screen ratio which you get with the flagships such as the Galaxy S8 and the Note 8. \n\nThe 720p resolution is not all that great. The battery will definitely benefit from this as the massive screen won\''t consume too much power since it\''s a low screen resolution display. On the other hand, you miss the extremely sharp display that you could get with a 1080p resolution and games like modern combat 5 that you saw lacked sharpness. Additionally, you can\''t enjoy 1080p video content either and are stuck with a 720p display.\n\nNo Auto brightness mode.\n\nGalaxy J8 OS/Software\n\nOn the software side, the J8 is running Android 8.0 Oreo with samsung experience version 9. Basically, it\''s Samsung\''s latest experience offering and comes with a few pre-loaded apps like the Google Suite of apps, the microsoft suite of apps some samsung goodies like smart things, voice recorder, internet browser, samsung pay mini, samsung mall, secure folder and samsung notes. It has an built-in FM player as well but only works with earphones connected. \n\nGalaxy J8 performance\n\nPowered by Snapdragon 450 1.8 GHz Octa Core processor which is at best a decent performer and comes with 4 GB RAM which is alright. The Antutu benchmark scores are really not high and is a mediocre 70,000. The Redmi Note 5 gives 76000, the Honor 7x gives 89000 and the Asus Zenfone Max Pro gives 114,000 in Antutu benchmark scores - all these devices are actually cheaper than the J8 and yet give better performance scores. So it\''s really something to think about if performance is something that drives your buying decision.\n\nThe J8 is not a slow device or it does not lag. But it\''s not blazing fast and that\''s alright because you\''re not paying a lot of money. \n\nGalaxy J8 Gaming\n\nGames mostly run smoothly. Tried playing chameleon run, modern combat 5 and asphalt 8. Asphalt 8 ran very smoothly with sharp to decent graphics.\n\nModern combat 5 ran smoothly, however, lack of 1080p display makes graphics look not so great.\n\nGalaxy J8 Build\n\nA polycarbonate unibody build and the quality doesn\''t feel too flimsy or cheap. It has this nice matte finish to it with a soft texture that feels good when holding in your hand. Some people prefer metal - but i don\''t really see that as a deal breaker of any kind.\nGalaxy J8 Design \n\nFrom a design perspective, it\''s infinity display which is essentially a close to bezel-less 18.5:9 screen which delivers a really immersive experience. So the bezels are slimmer than many of its competitors, but really don\''t expect its anything close to flagships like Galaxy s9 or OnePlus 6 or iPhone X. The chin and the forehead of the device are quite significant and far from a bezel-less design honestly.\n\nNo water resistance or water proofing - and that\''s ok because no phones in this segment have that.\n\nNo quick charging. \n\nFingerprint sensor at the back.\n\nJ8 supports two SIM cards and one microSD card to expand storage by 256 GB.\n\nYou have a microUSB port which is disappointing in the world of type C ports - and you get a regular charger with it which does not support fast charging. Still got the headphone jack!\n\nAlso, no notification LED - and again not sure why not! Most other phones in this category come with the notification LED and it\''s a pretty important thing\n\nThe royalty-free music used in this video is \''Back To The Stars\'' by Nazar Rybak.\n(www.melodyloops.com), licensed under Creative Commons \"Attribution 3.0\". I have given credit for the use of this music at the end in the video description. \nHere is a link to the terms of the license: \nhttp://www.melodyloops.com/support/fu...\nhttp://creativecommons.org/licenses/b...',7527,735598,520,'8-Jul-18','mobiscrub');
