INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('DIrLvjlsB0M','XK - Studio Projects | XK Studio | OFFF 2023','XK will showcase a collection of studio projects and talk about their process and approach to the work from a conceptual and technical point of view.\n\nAlexa Sirbu and Lukas Vojir are the founding artists of XK studio. A design and motion practice, with experimentation at its core, they specialize in the creation of high-end 3D visuals and films. The studio has evolved into a team of creative minds who adopt a blend of artistic and technical approaches to craft striking visuals for brands worldwide. Drawing inspiration from the worlds of nature, fashion and art, they focus on reimagining these concepts and exploring the boundaries of beauty through a digital, futuristic lens. They closely collaborate with their clients to produce mesmerizing motion, meaningful narratives and daring aesthetics.',380,7133,26,'19-May-23','Houdini');
