INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('xettUfh0-bg','CX TRENDS FOR 2023: the rise of empowered CX, bright cx and more!','Let\''s take a trip to the future, with my 10 most important CX trends for 2023: from the Top Gun\neffect to a new loyalty philosophy and from TikTok-ising your interface to ambient intelligence.\nWhich ones do you think will have the biggest impact?\n\nCONTENT: \n00:15 -  04:04 POSITIVITY WITH IMPACT\n04:04 - 6:46  THE RISE OF EMPOWERED CX\n6:46 - 10:13 BRIGHT CX\n11:41 - 14:37 RE-INVENTING CUSTOMER LOYALTY\n14:37 - 18:50 HELP CUSTOMERS MAKE MONEY\n18:50 - 20:46 THE POWER OF MICRO-DECISIONS\n20:46 - 23:04 TIK-TOK-ISE YOUR EXPERIENCE\n23:04 - 27:48 AMBIENT INTELLIGENCE REBORN\n\n-\nSteven Van Belleghem is a customer experience enthusiast! He loves to share this passion with a broad audience via keynote speeches, books and social media content. \n\n\nOver the past years Steven has given more than 1.500 presentations at events in over 45 countries. His core expertise is the future of customer centricity and customer experience. The combination between customer-centric thinking, the latest technologies and the human touch is the guiding principle in Steven\''s stories.\nSteven is an entrepreneur. He is the co-founder of inspiration agency Nexxworks and social media agency Snackbytes. As an investor he is also involved in the fast-growing digital agency IO Digital and AI scale-up Hello Customer. Finally, Steven is also on the board of directors of Plan International. \n\nIn addition to his entrepreneurial activities Steven is a part-time marketing professor at the Vlerick Business School and a guest lecturer at London Business School. His opinion is often shared in media like Forbes, Warc, The Guardian,... Steven has authored five international bestsellers and has sold more than 150,000 books. His work has been translated into seven languages and he is the recipient of a variety of awards (most innovative marketing book, best marketing book, best international business book).',154,277267,18,'27-Nov-22','Steven Van Belleghem');
