INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('yPWnf7PptwA','2022 DI men\''s NCAA cross country championship | FULL RACE','Northern Arizona won the DI men\''s cross county team title, finishing with 83 points. The Lumberjacks won a tiebreaker over Oklahoma State 3-2. It\''s the first time in DI men\''s cross country history that a tiebreaker determined the national champion. The only other tie came in 1942, before a tiebreaker was established. Northern Arizona has now three-peated, winning three titles from 2020-2022. \n\nWatch the full 10k race from the 2022 DI men\''s cross country championship.\n\nSubscribe to the NCAA Championship YouTube channel: https://www.youtube.com/NCAAChampions...',3921,400699,274,'19-Nov-22','NCAA Championships');
