INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('bkwaq2wcTNU','In Cold Blood | kaun khel rha hai Team CID ke sath Mystifying Game? | CID | siaidi | Full Episode','Click here to Subscribe to SET India:   \n / @setindia  \n\nA bunch of people are invited to play some mysterious game. Called in a mysterious house, every individual gets an envelope that consists of further instructions about the game. One of the participants, Rohit, gets the blank envelope and is feeling confused. A mysterious voice, which earlier guided the contestants, is heard again by Rohit who helps him procure a gun. Rohit gets the instructions of attacking someone. Who is that person? What is this game? Can CID solve this case? To know, watch the full episode.\n\nShow Name: CID \nShow Cast & Characters: \n* Shivaji Satam as ACP Pradyuman\n* Dinesh Phadnis as Inspector Fredricks aka Freddy\n* Ashutosh Gowariker as Sr. Inspector Virendra\n* Dayanand Shetty as Sr. Inspector Daya\n* Narendra Gupta as Dr. R. P. Salunkhe\n* Aditya Srivastava as Sr. Inspector Abhijeet\n* Shraddha Musale as Dr. Tarika\n* Ansha Sayed as Sub-Inspector Purvi\nProducer: Brijendra Pal Singh\n\n#CID #siaidi #CID2023 #CrimeThrillers #CrimeMysteries #Mysteries #Horror #NewCID #Crime #NewCID #LatestCID #setindia \n\nAbout CID:\n-----------------\nToday, the first thrilling investigative series on Indian Television is one of the most popular shows on Sony Entertainment Television. Dramatic and absolutely unpredictable, C.I.D. has captivated viewers over the last eleven years and continues to keep audiences glued to their television sets with its thrilling plots and excitement. Also interwoven in its fast-paced plots are the personal challenges that the C.I.D. team faces with non-stop adventure, tremendous pressure, and risk, all in the name of duty. The series consists of hard-core police procedural stories dealing with investigation, detection, and suspense. The protagonists of the serial are an elite group of police officers belonging to the Crime Investigation Department of the police force, led by ACP Pradyuman [played by the dynamic Shivaji Satam]. While the stories are plausible, there is an emphasis on dramatic plotting and technical complexities faced by the police. The plot throws up intriguing twists and turns at every stage to keep the officers on the move as they track criminals, led by the smallest of clues.\n\nClick here to watch the action-filled episodes of CID:\n  \n * In Cold Blood | CID  \n\nIn Cold Blood | kaun khel rha hai Team CID ke sath Mystifying Game? | CID| siaidi | Full Episode',45521,4460975,789,'24-May-23','SET India');
