INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('AhW3jlg7NQw','3 Interior Designers Transform The Same Galley Kitchen | Space Savers | Architectural Digest','We gave interior designers Courtney McLeod, Sasha Bikoff, and Becky Carter a photo of the same galley kitchen-then asked each of them to create a new design for it in their particular style, however they pleased with no restrictions. Three artists, one canvas, each bringing something different to the space. See which designer comes closest to creating your dream kitchen.\n\nRenders by Duke Renders http://www.dukerenders.com/start\n\nShop these galley kitchens!\n\nCOURTNEY\''S SPACE: \n(Similar) Etsy Handmade Blue Subway Tile: https://fave.co/43paKwt\n(Similar) Etsy Laurel Blossom Chandelier: https://fave.co/43nepuP\nAlessi Kettle: https://amzn.to/3OY2oYd\n\nSASHA\''S SPACE: \n(Similar) Wayfair Zebrawood Jacquard Fabric: https://fave.co/3Nf1020\n(Similar) IKEA Varmblixt LED Pendant Lamp: https://fave.co/3Nhmvzv\n(Similar) Lumens Reed LED Adjustable Picture Light: https://fave.co/3ORDY2C\n(Similar) Etsy High Output LED Strip: https://fave.co/42pB34c\n(Similar) CB2 Mick and Bianca Arriving at the London Airport Print: https://fave.co/3P61fOa\n(Similar) West Elm Ceramic Wall Planters: https://fave.co/3WTz9HR\n\nBECKY\''S SPACE\n(Similar) Etsy Travertine 1x1 Mosaic Wall Tile: https://fave.co/3oX5dOx\nChairish Italian Modern Omega Sconces by Vico Magistretti: https://fave.co/42n6QTn\n(Similar) Lumens WAC Lighting LED Circle Step Light: https://fave.co/3J0AtDg\n(Similar) Etsy Beach Printable Wall Art: https://fave.co/43C9QMY\n\nWhen you buy something through our retail links, we earn an affiliate commission.\n\nDesigner Portfolio Pictures by:\nNicole Cohen https://nicolecohenart.com/\nShade Degges http://www.shadedegges.com/\nSam Frost http://www.samfroststudio.com/\nJoseph Kramm https://www.josephkramm.com/\nChris Mottalini https://mottalini.com/\nJohn Neitzel