INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('4gXmClk8rKI','fromis_9 (PeuLoMiSeuNaIn) \''DM\'' Official MV','[Midnight Guest]Neun SaeByeog TalChulEul GamHaengHan PeuLoMiSeuNaInI MuLyoHan BamEul BoNaeGo IssNeun IDeulEul KkamJjag BangMunHae SeolLemEul SeonSaHaNeun AelBeomIDa. IlTalUi SunGanGwa DoSiUi Bam, GeuLiGo YeSangChi MosHan UiOeUi SangHwangDeulEul DaYangHaGe DamANaessEuMyeo GwaGamHan SiDoESeo BiLosDoen, JjaLisHaGo DuGeunDaeNeun GamJeongEul SaengSaengHaGe PyoHyeonHaessDa.\n\nTaITeulGog \''DM\''Eun SaeByeog TalChulE SeongGongHan PeuLoMiSeuNaInI JohAHaNeun IEGe DaGaGa GwaGamHaGe SaLangEul GoBaegHaNeun SunGanUi SeolLemEul DamEun GogEuLo, BanJjagINeun DoSiUi BamGwa BonGyeogJeogEuLo SaLangI SiJagDoel GeosMan GatEun DuGeunGeoLiNeun SunGanEul HamKke GyeongHeomHal Su IssNeun GogIDa. ALyeonHan NeuKkimUi KoDeu JinHaengGwa PeongKiHan BeISeu LaInI DodBoIMyeo SiWonHaGe TeoJiNeun HuLyeom PaTeuGa InSangJeogIn Pab JangLeuUi GogIDa.\n\nMidnight Guest follows the story of fromis_9 making an escape from home past midnight, promising an exciting visit to those undergoing a colorless night of boredom. Listeners are guided to vicariously live the moments of breaking free and of traversing through bright colors of the night in the city, of which thrills and unexpected encounters are vividly laid across the tracks.\n\nDriven by elements of pop, \"DM\" portrays the excitement of breaking free and the feelings of a racing heart from confessing one\''s feelings to their crush. The track paints a picture of a bright city night and a sense of love as it first begins to grow, through a sentimental chord progression and a funky bass line. Laced with fromis_9\''s endearing charms, the striking chorus of the track instantly hooks the listener in.\n\nCredits : \nPRODUCTION | SEGAJI\n\nDIRECTOR | INHOON LEE\nPRODUCER | JONGRYONG LEE\n1ST AD | JISOO HYUN\n2ND AD | DAHYE KIM\n\nDIRECTOR OF PHOTOGRAPHY | GIUNG SEO (LINE OF SIGHT)\n1ST AC | 