INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('43eppP5xNMc','W3 Funk Sessions Live at Ronnie Scott\''s','Line-up may differ each month: ED MITCHELL tenor sax; JACKSON MATHOD trumpet; CHRIS WEBSTER trombone; SARAH TANDY keys; CHRIS BOOTH guitar; PHIL SIMMONDS bass; LUKE HARRIS drums; JOAO CAETANO percussion\n\nW3 Funk Sessions - a new regular monthly show from this funk collective.\n\nW3 focuses on high energy performances, that draw influences from such bands as the JBs, Tower of Power, Herbie Hancock, right up until the modern day with such bands as Lettuce and Anderson .Paak. Comprised of top industry professionals who have performed and toured with such artists as: The Brand New Heavies, Incognito, Dionne Warwick, Rizzle Kicks, Gary Barlow, Jess Glynne, Peter Andre, just to name a few.\n\nThey bring their unique flavour to the funk genre with an all singing all dancing horn section and backline that locks in together in a way only gained from over a decade of performing together.',85,5588,7,'8-Jan-22','Ronnie Scott\''s Jazz Club');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('2-fKM82AzmA','Mystic Music for meditation - Azerbaijanian mugam on ud','Azerbaijanian musician Mircavad Ceferov  plays  mugam on ud. \n\n\nMugam also known as Azerbaijani Mugham (Azerbaijani: Mugam; mqm) is one of the many folk musical compositions from Azerbaijan, contrast with Tasnif, Ashugs. Mugam draws on Iranian-Arabic-Turkish Maqam.\n\nIt is a highly complex art form that weds classical poetry and musical improvisation in specific local modes. \"Mugham\" is a modal system. Unlike Western modes, \"mugham\" modes are associated not only with scales but with an orally transmitted collection of melodies and melodic fragments that performers use in the course of improvisation. \"Mugham\" is a compound composition of many parts. \n\nThe choice of a particular mugham and a style of performance fits a specific event. The dramatic unfolding in performance is typically associated with increasing intensity and rising pitches, and a form of poetic-musical communication between performers and initiated listeners.\nThree major schools of mugham performance existed from the late nineteenth and early twentieth centuries - the region of Garabagh, Shirvan, and Baku. The town of Shusha (Garabagh) was particularly renowned for this art.\nThe short selection of Azerbaijani mugham played in balaban, national wind instrument was included on the Voyager Golden Record, attached to the Voyager spacecraft as representing world music, included among many cultural achievements of humanity.\nIn 2003, UNESCO recognized mugam as a Masterpiece of Oral and Intangible Cultural Heritage of Humanity.\n\nAzerbaijan also has a great tradition of composers and musicians of western classical music. Uzeyir Hajibeyov with his Leili and Majnun created the genre of mugham-opera. Fikret Amirov (1922-1984) was the first Azeri composer symphonic mughams -- Kurd, Ovshari, and Gulistan Bayati Shiraz. Azerbaijani composers created a plethora of compositions that fused mugham and traditional European genres.  Such works are obviously very different from traditional mugham formations but in fact incorporate many mugham idioms. On the level of musicians, there remains a strict separation between classical and \"traditional\" music in terms of training. Even if the musicians are educated at the same conservatorium they stick to one camp.\n\nmugam, mugham, mugam, mugamat, nirvana, meditation, mystic music, mystical music, Azerbaijan  folk music,',4967,429567,524,'29-May-10','Khan Araz');
