INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('V-cvlZLNEBM','The TH Sound | Phonics Video | Scratch Garden','The TH Sound phonics video teaches the correct English pronunciation of the TH letters. The TH sound is a very important consonant digraph! \n\nLike our videos? Help support us on Patreon (and access over 50 member-only videos!) >> https://www.patreon.com/scratchgarden <<\n\nConsonant digraphs (also called letter digraphs) are 2 letters that make a new sound when they are put together.  TH actually has 2 different sounds that are often used in the English Language and this video teaches you what you should know about the voiced vs voiceless TH sounds. \n\nWhether teaching ESL or learning to read the English language, this video is sure to help you learn English phonics and pronunciation quickly and happily. \n\nMore Scratch Garden Phonics Videos here:   \n * Phonics | Digraphs  \n\nWatch more English language learning videos:   \n * English Learning ...  \n\nWe love to teach with music! Watch Scratch Garden Educational Song Videos here:   \n * Scratch Garden Le...    \n\nScratch Garden makes entertaining educational videos for people that like to laugh and learn! Please Subscribe to see more great fun learning videos from Scratch Garden! https://goo.gl/1biPjA\n\nOUR FIRST BOOK IS NOW AVAILABLE! http://amzn.to/2Fm2B0L\n\nWebsite: https://www.scratchgarden.com\nInstagram: https://www.instagram.com/scratchgarden\nFacebook: https://www.facebook.com/scratchgarden',8222,1993340,0,'15-Oct-18','Scratch Garden');
