INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('5zLavXrRNio','Quando Rondo - S2 (Official Music Video)','Quando Rondo -  S2 (Official Music Video)\nStream/Download: https://quandorondo.lnk.to/StillTakin...\n\nSubscribe for more official content from Quando Rondo: https://1633.lnk.to/QuandoRondoSubscribe\n\nFollow Quando Rondo\nhttps://facebook.com/QuandoRondo\nhttps://instagram.com/quando_rondo\nhttps://twitter.com/quando_rondo\nhttps://soundcloud.com/quandorondo\n\nA natural talent, Quando Rondo was once a small child, secretly singing in the bathroom as a 9-year-old boy in Savannah, GA. His natural gravitation towards music lead to him to hip-hop; he began recording his fledgling verses on his cell phone. He quickly gained traction online, racking up millions of views on YouTube.\n\nFittingly, he titled his 2018 mixtape \''Life B4 Fame\'' with the hopes that things would change for the better once his career really took off. He was right-within two days, his mixtape had amassed more than one million streams on MyMixtapez. Things will only go up from there, and if the snippets from his forthcoming Rich Homie Quando project are any sign, he\''s only only getting better with time.',67491,3291314,4084,'14-Jun-21','Quando Rondo');
