INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('dtohea4CFbE','Mo | Official Trailer | Netflix','Mo Najjar straddles the line between two cultures, three languages and a ton of bullshit as a Palestinian refugee constantly living one step away from asylum on the path to U.S. citizenship. His family - including his resilient and spiritual mother, sister and older brother - flee to Houston, Texas. Laughing the pain away, Mo learns to adapt to his new world though getting ahead in life comes with several setbacks.\n\nMo Amer stars in Mo, premiering Aug 24 on Netflix.\n\nSUBSCRIBE: http://bit.ly/29qBUt7\n\nAbout Netflix:\nNetflix is the world\''s leading streaming entertainment service with 221 million paid memberships in over 190 countries enjoying TV series, documentaries, feature films and mobile games across a wide variety of genres and languages. Members can watch as much as they want, anytime, anywhere, on any Internet-connected screen. Members can play, pause and resume watching, all without commercials or commitments.\n\nMo | Official Trailer | Netflix\n  \n / netflix  \n\nIn Texas, Mo straddles the line between two cultures, three languages and a pending asylum request while hustling to support his Palestinian family.',15294,973128,1057,'9-Aug-22','Netflix');
