INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('cwxbIQmL3Fk','KA | Zomersessie 2019 | 101Barz','Hella Cash is in het gebouw! KA heeft een beat van YassineBeats meegenomen en sluit het zomerseizoen af met een ijskoude sessie! \n\n#KA #HELLACASH #ZOMERSESSIE #101BARZ\n\n101Barz is het grootste hiphop-platform van Nederland met wekelijks nieuwe video\''s. Natuurlijk brengt Rotjoch elke week de welbekende studiosessies op je beeldscherm, maar dat is niet alles. Videoclips van je favoriete artiesten die gemaakt zijn door het 101Barz-team vind je onder de noemer 101Barz Videoclipz. Items en portretten van beginnende rappers en gevestigde namen worden met regelmaat geupload. In Hitmakerz nemen we je mee achter de schermen bij de producers van de dikste hits van Nederlandse bodem. De rappers met de best bekeken sessies krijgen bezoek van Rotjoch om een Trophy in ontvangst te nemen. \n\nIn 2006 had Rotjoch het idee om onder de vleugel van BNN het hiphopplatform 101Barz op te zetten. Rappers kwamen langs voor studiosessies en binnen de kortste keren was 101Barz een begrip in Nederland.  Welke bekende rapper begon niet zijn carriere bij 101Barz? \n\nVoor de laatste videoclips van derden, nieuwtjes en interviews kun je terecht op de site\nhttp://www.101barz.bnn.nl\n\nVolg ons ook op social media:\n\nTwitter: http://twitter.com/101barz \nFacebook: https://www.facebook.com/101BarzOffic...\nInstagram: http://instagram.com/101barzbnn/ \nSoundcloud: https://soundcloud.com/101barzbnn\nSnapchat: Barz101',73427,10738025,6766,'20-Sep-19','101Barz');
