INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('AhhLJKCKPuc','Our Favorite Airbnb in Cebu, I lost, How we bond as a family','We made it to another beach trip with the Uy family! We really are beach people. Is there anyone here who loves the beach as much as we do? There is just something about the crashing waves or being close to the shore that brings us comfort and happiness. Blue Agave has got to be my favorite Airbnb in town. The flow of the villa, the big open spaces and the wide white sand beach are the best parts. I could totally imagine just packing up and moving here! Would you ever move from city life to the beach? I totally would!\n\nThis whole trip was so memorable for me for a number of reasons. Looking back at these clips now makes me so sentimental. I\''m so happy to have family as close as this. I\''m thankful we can play games together and forget we are adults, even just for a little bit. I hope we can keep doing this until we are old and our kids get embarrassed at how competitive we are. lol\n\nHope you guys enjoy this one!\n\nThanks Deedoe for editing the Amazing Uy Race Segment! \n  \n * Another Family Be...  \n\nLinks to products mentioned:\nBlippi Sunglasses https://s.lazada.com.ph/s.hFHKs?cc\nFoldable Sunglasses https://s.lazada.com.ph/s.hMLyt?cc\nSpeedo Goggles https://s.lazada.com.ph/s.hFHIO?cc\nOff Lotion Baby https://s.lazada.com.ph/s.hFHtB?cc\nMoski Shield Stickers https://s.lazada.com.ph/s.hFHwS?cc\nBaa Baa Sheepz Pillows https://s.lazada.com.ph/s.hFHCU?cc\nHalo Sleep Sack https://s.lazada.com.ph/s.hFHBN?cc\nCryo Balls https://s.lazada.com.ph/s.hfd4x?cc\nShiseido Skincare Travel Size https://s.lazada.com.ph/s.hKJ2D?cc\nAnessa Sunblock https://s.lazada.com.ph/s.hFt1T?cc\nBocu Set for kids https://s.lazada.com.ph/s.hpPXX?cc\nChicco Stoller https://s.lazada.com.ph/s.6KZ88?cc\nKiss Me Mommy Sunblock https://s.lazada.com.ph/s.hFt2o?cc\nShiseido Facial Cleanser https://s.lazada.com.ph/