INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('d9f3mzkhsMw','2023 Audi R8 GT vs The Cheapest Audi R8 You Can Buy','The 2023 Audi R8 GT ($302,600 in Canada, $253,290 in the US) is up against its V8 ancestor, the 2009 R8 ($63,995 in the US, $85,000 in Canada). Price difference aside, these two Audi supercars command a striking mid-engine road presence and an exotic yet comfortable experience. \n\nThe elder R8 is known for its gated manual transmission that provides extra driver engagement and comes with a blazing 420 horsepower out of 8 cylinders. The R8 GT however has a newly updated 7-speed automatic transmission, a slew of carbon fibre and weight savings, and a horsepower number over 600 coming from a sonorous V10. How does the last hoorah of the Audi R8 stack up against its much more affordable ancestor? Thomas and James are excited to find out! We hope you enjoy the episode. Subscribe! \n\nHuge thank you to @love2shift for loaning us their gated R8 and to @Brandon_sage for making it happen!\n\nEditor: Karston Chong \nSound: Harrison Dickson and Karston Chong \nMagical Genius Logistics Planners: James Engelsman and Gregory DeCaire',20939,413582,1254,'7-Jun-23','Throttle House');
