INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('WAkXS8lgoA0','Thiamine (Vit B1) Deficiency Signs & Symptoms (& Why They Occur)','Thiamine (Vit B1) Deficiency Signs & Symptoms (& Why They Occur)\n\nThiamine (vitamin B1) is a vitamin required for energy metabolism, including the metabolism of glucose. Thiamine deficiency can caused by a decreased dietary intake, decreased absorption, increased utilization or increased losses. A thiamine deficiency can initially cause vague symptoms, and then subsequently may lead to conditions like Wet and Dry Beriberi, Wernicke\''s encephalopathy, and Korsakoff\''s syndrome. In this lesson, we discuss the early symptoms of thiamine deficiency, including the signs and symptoms of the Beriberi conditions and Wernicke-Korsakoff syndrome.\n\nI hope you find this lesson helpful. If you do, please like and subscribe for more lessons like this one!\n\nJJ\n\n**MEDICAL LEGAL DISCLAIMER**: JJ Medicine does not provide medical advice, and the information available on this channel does not offer a diagnosis or advice regarding treatment. Information presented in these lessons is for educational purposes ONLY, and information presented here is not to be used as an alternative to a healthcare professional\''s diagnosis and treatment of any person/animal. Only a physician or other licensed healthcare professional are able to determine the requirement for medical assistance to be given to a patient. Please seek the advice of your physician or other licensed healthcare provider if you have any questions regarding a medical condition. \n\n*AFFILIATE DISCLAIMER: This YouTube Channel uses affiliate links and may earn a commission from associated sales. \n\nIMAGE DISCLAIMER: The content (ex. images) used in this lesson are used in accordance with Fair Use laws and are intended for educational/teaching purposes only\n\nSubscribe for more free medical lessons   \n / @jjmedicine',5111,325620,278,'30-Sep-21','JJ Medicine');
