INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('caIqMaGW4h0','101 Historias de Innovacion | IE Editorial Knowledge Series','Has there ever been a time when there is a better case for innovation than now?\"\n\n\"101 Innovation Stories\", an event introduced by Lee Newman, Dean of IE Business School, and inspired by the collaborative book of the same name, written by Daniel Medina, professor at IE Business School, and Cristian Ull, both co-founders of Area101.\n\nDuring the session, CEOs, experts and innovation leaders from IBEX35 and global companies such as Airbus, LaLiga, Amazon, Sacyr and Repsol, who have been part of the 101 stories of the book, shared strategies and methodologies with which they have achieved multiple successes in their companies leading their innovation units.\n\nAn agile and entertaining debate, with several stories and multiple anecdotes shared by the experts, who transmitted their passion for innovation and encouraged attendees to take risks, to face their fears, to be perseverant and not to resist the changes and evolution necessary in organizations to keep \"\"inspiring the world\"\".\n\nThe authors believe in the democratization of information so you can find all the stories of innovation in open access at the following link: https://bit.ly/42gzIwz',0,11,0,'8-Jun-23','IE University');
