INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('_MRipuTY1yI','Dung Dai Dot Thuc Hien 7 Nghi Thuc Goi MA Dang So Tren The Gioi','Dung Dai Dot Thuc Hien 7 Nghi Thuc Goi MA Dang So Tren The Gioi\n\nDang ky kenh: http://bit.ly/thegioihomnay\n\nThe gioi hom nay xin chao cac ban. Dau tien, hay BINH LUAN cho minh biet, lieu rang ban co tin rang ma quy that su co ton tai hay khong nhe. Du ban co dang tin hay khong, thi nhung tro choi mang tinh tam linh, keu goi ma quy van dang ton tai hang ngay. Hay nhin nhom ban nay, chi voi vai ngon tay, ho khong the nao nhac bong anh chang do con nay, the nhung chi sau vai giay thuc hien nghi le, trieu hoi suc manh linh hon, ho da khien anh chang nay nhe nhu bong va nhac cai mot, khien anh ta cung phai so hai. Tren thuc te, nhung suc manh tam linh luon vuot khoi tam kiem soat cua con nguoi, do do ma nhung nghi thuc goi ma luon tim an rat nhieu moi nguy hiem, no co the khien ban am anh ca doi, tham chi la bien mat ma khong ai he hay biet. Hay cung the gioi hom nay diem qua ngay 7 nghi thuc trieu hoi ma quy dang so nhat tren the gioi ma ban khong nen dai dot thu qua nhe\n\n00:00 7 Nghi Thuc Goi Ma Dang So Tren The Gioi\n01:05 Ouija \n02:17 Choi Ma Lon \n03:27 Charlie Charlie \n04:48 Spirit of the Coin \n05:44 Bloody Mary \n07:20 The Midnight Game\n08:55 Hide and Seek with the Devil \n\nContact us:\nFacebook: https://www.facebook.com/diep.trang2\nTikTok: https://www.tiktok.com/@thegioihomnay_yt\nEmail: topbian.tv@gmail.com\n\n#TheGioiHomNay #TGHN',381,52997,25,'7-Jun-23','WORLD TODAY');
