INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('IDmcymvFqHw','07 Zglos sie - Odcinek 12 \"Scigany przez samego siebie\"','\''\''07 zglos sie\''\'' to glosny, o ile nie najglosniejszy polski serial kryminalny, nie tylko z czasow PRL. \nTytulowy 07 to porucznik Slawomir Borewicz, ktory dzielnie stawial czola najgrozniejszym przestepcom: poczawszy od handlarzy narkotykow, skonczywszy na seryjnych mordercach. \nSerial okazal sie przepustka do kariery aktorskiej dla blyskotliwego dziennikarza. Bronislaw Cieslak stworzyl kreacje ironicznego, inteligentnego i bezkompromisowego przedstawiciela wladzy ludowej. Porownujac go do filmowych detektywow zachodnich, bardzo przypomina Brudnego Harry\'' ego w wykonaniu Clinta Eastwooda.\n\nW jednej z warszawskich kamienic dochodzi do tragedii - podczas mycia okna z trzeciego pietra wypada na dziedziniec Maria Jagodzinska, na co dzien opiekujaca sie chorym mezem na wozku (rzekomo choruje na sclerosis multiplex), ktory w czasie wypadku na chwile opuszcza mieszkanie. Mimo ze wyglada to na samobojstwo, zeznania sasiadow wskazuja na dziwne okolicznosci: zgaszone swiatlo w mieszkaniu po wypadnieciu ofiary, dluga nieobecnosc meza, buty na jego nogach, podczas gdy normalnie mial kapcie. Sekcja zwlok wskazuje na udar serca ofiary. Okazuje sie, ze siostra ofiary, Klementyna, kochala Henryka, jednak on wybral Marie. Nastepnie Klementyna Nawrocka zostaje zamordowana podczas kapieli w wannie. Podwojnym morderca okazuje sie Jagodzinski, ktory zgladzil obie ofiary, gdyz mogly ujawnic szczegoly z przeszlosci, jako ze byl takze sprawca napadu pod bankiem podczas zimy stulecia 1978/1979. Morderca ucieka z mieszkania, ale zostaje zastrzelony przy probie nielegalnego przekroczenia granicy w Chyznem.\n\nW odcinku zarysowany jest rowniez watek osobisty Borewicza, podane sa fakty z jego przeszlosci, informacje o zwiazkach uczuciowych porucznika oraz przedstawione jest spotkanie z byla zona - obecnie zamezna z obywatelem Libanu - ktora w przeszlosci rzekomo miala byc w ciazy z Borewiczem. \n\nRezyseria:  \nKrzysztof Szmagier (odc. 1-8, 10-12, 14-21)\nAndrzej Jerzy Piotrowski (odc. 9)\nKazimierz Tarnas (odc. 13)\n\nScenariusz:  \nKrzysztof Szmagier\nMichal Komar\nAndrzej Kaminski\nStefan Klonowski\n\nMuzyka: \nAndrzej Korzynski\nWlodzimierz Korcz\n\nZdjecia:  \nWieslaw Rutowicz\nJan Hesse\n\nScenografia:  \nAdam T. Nowakowski\nRoman Rozycki \n\nObsada:\n\nBronislaw Cieslak jako porucznik Slawomir Borewicz\nZdzislaw Kozien jako porucznik Antoni Zubek\nZdzislaw Tobiasz jako major Wolczyk\nEwa Kuzyk-Florczak jako sierzant Ewa Olszanska\nBozena Krzyzanowska jako Maria Jagodzinska\nHelena Kowalczykowa jako starsza sasiadka Jagodzinskich\nGustaw Kron jako Henryk Jagodzinski\nIrena Kownas jako Hanyszowa, sasiadka Jagodzinskich wzywajaca pogotowie\nMaria Homerska jako Eliza Hoffman, sasiadka Jagodzinskich\nGrazyna Dylag jako Klementyna Nawrocka, siostra Jagodzinskiej\nIzabela Trojanowska jako Joanna Borewicz, byla zona porucznika\nAnna Skowron jako recepcjonistka w hotelu \"Victoria\"\nCzeslaw Mroczek - portier w hotelu \"Victoria\"\nWojciech Sztockinger jako daktyloskopista Janek\nElzbieta Kijowska jako prokurator Zofia Oldakowska\nAntonina Girycz jako Kepinska, sasiadka Nawrockiej\nMaciej Dzienisiewicz jako Zdzislaw Kepinski, sasiad Nawrockiej\nMarek Bargielowski jako Franciszek Bronowicz, kochanek Nawrockiej, dyrektor\nBozena Walter jako dziennikarka tv prowadzaca program o napadzie pod bankiem podczas zimy stulecia\nJerzy Lipinski jako major MO w programie telewizyjnym o napadzie pod bankiem podczas zimy stulecia\nJerzy Prazmowski jako Jerzy Wolik, swiadek napadu na bank wystepujacy w programie telewizyjnym\nRyszard Gajewski jako milicjant\n\n------------------------------------------------------------------------------------\n\nZgodnie z zasadami YouTube film jest wolny do publikacji, jednak nie podlega monetyzacji na zadnym etapie rozwoju kanalu, i publikowany jest wylacznie w formie rozrywki, edukacji, oraz promocji rodzimej Kinematografii oraz Historii.',165,34225,16,'25-Feb-23','Rafal B');
