INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('53tGKFRtgNs','She Lives RENT FREE and Makes 6 Figures With Tiny Houses! (You Can Too)','On this episode of The Table with Anthony ONeal, Precious Price joins to share her secret to generating extra income with tiny houses. With a creative mindset and a passion for unconventional living, she has managed to hack her way into living rent-free while earning money on the side. Through her journey, she has become an expert in the tiny house movement and now shares her knowledge and experiences with others. In this video, she will guide you through some of the steps she took to start her own consulting business, including finding affordable land, designing and building tiny houses, and marketing them for profit. But it doesn\''t stop there, She also reveals her strategies for living rent-free by leveraging unique housing opportunities and reducing expenses. If you\''re looking to boost your income, learn about the tiny house movement, or simply explore alternative living arrangements, this video is a treasure trove of insights and inspiration. Join us as she shares her story and teaches you how to create your own path to financial freedom through tiny houses.\n\nMentioned On Today\''s Show:\n:handshake: Ethos Life Insurance: https://anthonyoneal.com/ethos\n:handshake: Chime: https://www.chime.com/ttao\n:handshake: @PreciousPrice : https://www.instagram.com/preciouscpr...  & https://www.instagram.com/land.rift/\n:handshake: Precious\'' Consulting: https://bit.ly/3pXypFu \n\nChime is a financial technology company, not a bank. Banking services and debit card provided by The Bancorp Bank, N.A. or Stride Bank, N.A.; Members FDIC. Early access to direct deposit funds depends on payer. SpotMe eligibility requirements and overdraft limits apply. See chime.com/spotme\n\nCheckout My Network Partners:\n:handshake: Bethel Tech: https://www.anthonyoneal.com/Bethel\n:handshake: Better Help: https://anthonyoneal.com/betterhelp\n:handshake: Chime: chime.com/ttao\n:handshake: Ethos Life Insurance: https://anthonyoneal.com/ethos\n\nFREE Webinar: \n:computer: The Personal Brand Masterclass: https://anthonyoneal.com/masterclass \n \nRECOMMENDED Reading\n:notebook_with_decorative_cover:  Debt Free Degree: https://amzn.to/3jA8GfR\n:notebook:  Destroy Your Student Loan Debt: https://amzn.to/3uG5wNQ\n:notebook:  Essentialism: The Disciplined Pursuit of Less:  https://amzn.to/37iUUf1\n:blue_book: The Ruthless Elimination of Hurry: https://amzn.to/3uEiKdW\n\n:microphone2: Listen to the show \niTunes: https://apple.co/2Wb2FhG\nSpotify: https://open.spotify.com/show/1DnGlzL...\n\nGET IN TOUCH\n:earth_africa: My website - https://www.AnthonyONeal.com\n:earth_africa: Advertise With Me - partnership@anthonyoneal.com\n\nConnect with Me!\nInstagram: @anthonyoneal\nFacebook: @anthonyoneal\n\nWho I AM: \nHey, fam! I\''m Anthony and I\''m here to help you discover your authentic self and achieve spiritual, financial, and mental freedom. I know what it\''s like to be in debt and homeless - I\''ve been there. But with the grace of God, I was able to turn my life around and I\''m now helping others to do the same. \n\nJoin me on my YouTube channel and let\''s start this journey together. I\''ll share my experiences, tips, and tools to help you achieve success and become debt-free. Plus, you can follow me on Instagram @AnthonyONeal and visit anthonyoneal.com for more resources and help. \n\nSubscribe now and join the AO fam! Let\''s get to it!\n\nHave A Questions You Would Like Asked On The Show: \nTweet me @anthonyoneal or email me at anthony@anthonyoneal.com. If your question is long, I might not read it, just being honest. :grin:\n\nDisclaimer: Some of these links are affiliate links, which means I may get a commission if you purchase. However, none of the fees of these resources have been increased to compensate me. In fact, many of these have given me special discounts that I get to extend to you! :wink:',1002,18765,78,'22-May-23','The Table With AO');
INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('Pib8eYDSFEI','The xx - Crystalised (Official Video)','Romy\''s debut solo album Mid Air is available 8th September: https://romy.ffm.to/midair\n\nCoexist 10th Anniversary Clear Vinyl Edition is available now: https://thexx.ffm.to/coexist-physical\n\nSubscribe to The xx on YouTube: https://bit.ly/3UfEd7Z\n\nThe xx - \"Crystalised\" (Official Video)\n\"Crystalised\" from The xx\''s debut album \''xx.\'' \nSubscribe to The xx\''s channel to stay up to date with all their latest videos.\n\nYou\''ve applied the pressure\nTo have me crystalised\nAnd you\''ve got the faith \nThat I can bring paradise\n\nDirected by Alex Flick and Masato Riesser\n\nVisit The xx store: http://xxe.ht/pohs\n\nListen to The xx essentials on Spotify: http://xxe.ht/psslaitnesse\n\nGet \"Crystalised\" from the album \''xx\'' here: \nStream \nSpotify: http://xxe.ht/psxx\nApple Music: http://xxe.ht/maxx\n\nDownload\niTunes: http://xxe.ht/tixx\nGoogle Play: http://xxe.ht/pgxx\nAmazon: http://xxe.ht/tzmaxx\n\nFollow The xx: \nWebsite: http://xxe.ht/ofni\nFacebook: http://xxe.ht/koobecaf\nInstagram: http://xxe.ht/margatsni\nSpotify: http://xxe.ht/yfitops\nTwitter: http://xxe.ht/rettiwt \n\n\nSee The xx live: http://xxe.ht/ruot\n\nLyrics\nYou\''ve applied the pressure\nTo have me crystalised\nAnd you\''ve got the faith \nThat I can bring paradise\n\nI\''ll forgive and forget\nBefore I\''m paralyzed\nDo I have to keep up the pace\nTo keep you satisfied \n\nThings have gotten closer to the sun\nAnd I\''ve done things in small doses\nSo don\''t think that I\''m pushing you away\nWhen you\''re the one that I\''ve kept closest\n\nYou don\''t move slow\nTaking steps in my direction\nThe sound resounds, echo\nDoes it lessen your affection\nNo\n\nYou say I\''m foolish \nFor pushing this aside\nBut burn down our home\nI won\''t leave alive\n\nGlaciers have melted to the sea\nI wish the tide would take me over\nI\''ve been down on my knees\nAnd you just keep on getting closer\n\nGo slow, go slow, go slow\n\n#Thexx #OpenEyes #ThexxSongs\n\nThe xx - xx > https://bit.ly/3RETuMP\nThe xx - Coexist > https://bit.ly/3T1UzQ1\nThe xx - I See You > https://bit.ly/3SZIzi6',362389,77165914,13228,'27-Apr-09','The xx');
