INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('PPdRdBc9EyY','The WR Sound | Phonics Video | Scratch Garden','The WR Sound phonics video teaches the correct English pronunciation of the WR letters. \n\nThe WR sound is a very important consonant digraph. Consonant digraphs (also called letter digraphs) are 2 letters that make a new sound when they are put together. If you are looking to practice or learn English speaking, this consonant blends video is perfect for understanding the WR sound in English. Without the WR sound there would no WRiting, or WRong answers!\n\nWhether teaching ESL or learning to read the English language, this video is sure to help you learn English phonics and pronunciation quickly and happily. \n\nMore Scratch Garden Phonics Videos here:   \n * Phonics | Digraphs  \n\nWatch more English language learning videos:   \n * English Learning ...  \n\nWe love to teach with music! Watch Scratch Garden Educational Song Videos here:   \n * Scratch Garden Le...    \n\nScratch Garden makes entertaining educational videos for people that like to laugh and learn! Please Subscribe to see more great fun learning videos from Scratch Garden! https://goo.gl/1biPjA\n\nOUR FIRST BOOK IS NOW AVAILABLE! http://amzn.to/2Fm2B0L\n\nWebsite: https://www.scratchgarden.com\nInstagram: https://www.instagram.com/scratchgarden\nFacebook: https://www.facebook.com/scratchgarden\n\n#digraphs #digraphsounds #phonics',536,371399,0,'10-Oct-22','Scratch Garden');
