INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('_mCOCkmyU0I','Giant Lego Man vs. T-Rexs: A Lego Adventure with Jannie Charlotte and Eric','Jannie, Eric, and Charlotte as they construct amazing creations with a giant Lego man in their Lego room. Their fun is disrupted by an overly enthusiastic T-Rex who, in his excitement, ends up toppling over their Lego castle!\n\nUndeterred, our young heroes ask the giant Lego man for help and together, they build a strong barrier to protect their creations from the playful dinosaur. Victory is celebrated and the playroom becomes a space of creative building once again.\n\nHowever, there\''s more to the story! At the T-Rex lair, we learn that the green T-Rex was just excited to play with Legos and wanted to be friends with the kids. The blue T-Rex decides to help and together, they carry their own Lego pieces to make peace with the kids.\n\nUpon their arrival, the kids are initially scared. They call upon the giant Lego man to defend their playroom. The T-Rexs, scared of the giant Lego man, accidentally destroy more of the Lego creations and break the Lego man into pieces.\n\nOnce the kids realize that the T-Rexs were only trying to help and fix the giant Lego man, apologies are exchanged and new friendships are forged. The T-Rexs even share their Lego pieces with the kids. Together, they rebuild the giant Lego man and continue their playful and creative adventures, proving that friendship and understanding can turn even the biggest fright into a delightful playmate. So tune in for a roarsome time!\n\n\nSubscribe for notifications to new videos:   \n / @toysandcolors  \n\nCheck out our latest videos playlist:   \n * Emma & Jannie Pre...',224,50267,0,'7-Jun-23','Toys and Colors');
