INSERT INTO YouTubeVideoTable(id,title,description,likes,views,comments,date_published,publisher) VALUES ('grwenSr9lQ8','Claw Machine Chooses What I Paint','Hey guys! Today I am continuing my series of painting and customizing anything I can manage to win out of my claw machine. I\''ve crammed so many cute prizes in this machine that would all make for really fun painting projects. I could win anything from a tumbler, hat, or mini packpack, to a squishy, plushie or squishmallow! This combines playing with my claw machine AND painting on things. Two things, I\''m obsessed with. \n\n__________WELCOME TO MY CHANNEL_________\n\nHey! my name is Moriah (pronounced muh-rye-yuh :joy: ) and this is my channel....obviously. I\''m 28 and like doing anything creative...and being snarky.....just a lil. I make a lot of decorating, painting and general art videos here. I\''m obsessed with editing and adding lil bits to my videos, so if that\''s not your thing....oof you may hate this haha. I paint on squishies, thrift store finds, and other random things I pick up. I also love to draw, but don\''t expect anything too skilled, I\''m not the best at that haha. You will also find occasional crafting/testing crafting kits on my channel which are always a hot mess. And even some baking (REALLY bad at that, but it\''s fun to try). \n\nCURRENT SERIES:\nSquishy Makeovers: Fixing and decorating used squishies sent from my viewers\nThrift Store Makeovers: Fixing and decorating stuff I find at thrift stores/yard sales\nBake With ME: Recreating squishies I\''ve decorated in real life\nCreate This Book: Drawing in the prompt book that I wrote (available to purchase and follow along)\nSquishy Unboxing: Opening used squishy packages sent from viewers\n\nFind Products I Use (contains affiliate links):\nhttps://a.co/4XDtrmV\n\n\n__UPLOAD SCHEDULE__\n\nEvery Friday at 4:00pm ET: Alternating Squishy Makeovers, Thrift Makeovers, Craft Kit Reviews, Create This Book, Mail Openings and Miscellaneous crafts and DIYs\n\n___DOWNLOAD SPARK___\nDownload Spark: https://apple.co/3gPrlWP\nJoin Discord Community: https://discord.gg/w48nSSm3s4\n\n___PURCHASE ME PRODUCTS___\n\nCREATE THIS BOOK:\nhttps://amzn.to/2vUerfI\n\nCREATE THIS BOOK 2:\nhttps://amzn.to/2Nx2G9f\n\nME Merchandise:\nhttps://moriahelizabethmerch.com/\n\n\n___ME SOCIALS___\n\nINSTAGRAM: \nhttps://www.instagram.com/moriaheliza...\n\nTIKTOK:\nhttps://www.tiktok.com/@moriahelizabeth\n\nFACEBOOK:\nhttps://www.facebook.com/Moriah-Eliza...\n\nSNAPCHAT:\nMoriahOfficial\n\nVISIT ME WEBSITE:\nhttps://www.moriahelizabeth.com/\n\n\n___CONTACT ME___\n\nEMAIL PICTURES OF YOUR ART:\nArtwork@Moriah.video\n\nFOR BUSINESS INQUIRIES/OPPORTUNITIES ONLY:\nmoriah@nightmedia.co\n\n\n____MAIL ME____\n\nFor sending squishies, Letters, or general fan mail, please contact: FANMAIL@MORIAH.VIDEO to request my P.O. box address \n(must be 13+ to send mail)\nATTENTION: Unfortunately I can only give out my address to a small amount of people each week. This is to make sure that I get a reasonable amount of mail and can feature the maximum amount on camera. I apologize in advance if you do not recieve the address.',59774,2030633,5620,'26-May-23','Moriah Elizabeth');
